INSERT INTO `jindong_goods` ( `goods_id`, `cat_id`, `goods_sn`, `goods_name`, `goods_name_style`, `click_count`, `brand_id`, `provider_name`, `goods_number`, `goods_weight`, `market_price`, `shop_price`, `promote_price`, `promote_start_date`, `promote_end_date`, `warn_number`, `keywords`, `goods_brief`, `goods_desc`, `goods_thumb`, `goods_img`, `original_img`, `is_real`, `extension_code`, `is_on_sale`, `is_alone_sale`, `integral`, `add_time`, `sort_order`, `is_delete`, `is_best`, `is_new`, `is_hot`, `is_promote`, `bonus_type_id`, `last_update`, `goods_type`, `seller_note`, `give_integral`, `rank_integral`, `suppliers_id`, `is_check`, `is_shipping` ) VALUES  ('446', '686', 'ECS000446', '50°三星贵宾郎酒500ml', '+', '0', '170', '', '1', '0.000', '182.00', '45.00', '0.00', '0', '0', '1', '', '', '<h4 class=\"h4_ass\" sizset=\"36\" sizcache=\"39\">商品特点</h4>\r\n<p>&nbsp;</p>\r\n<dl class=\"ass_share_dl2 clearfix\" sizset=\"39\" sizcache=\"17\">\r\n<table width=\"780\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" sizset=\"39\" sizcache=\"17\">\r\n    <tbody sizset=\"39\" sizcache=\"17\">\r\n        <tr sizset=\"39\" sizcache=\"17\">\r\n            <td sizset=\"39\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/11658/f/1380360240368.jpg\" alt=\"\" /></td>\r\n            <td>&nbsp;</td>\r\n            <td>\r\n            <p><font color=\"#333333\" size=\"2\"><strong>酒体清澈 绵甜爽净</strong></font></p>\r\n            <p><font color=\"#666666\" size=\"2\">郎酒三星贵宾酒，包装高贵典雅，其酒秉承百年传统工艺，老窖发酵，混烧蒸馏，精心酿制而成，具有清澈透明，窖香浓郁，绵甜爽净，回味悠长的特点。</font></p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</dl>\r\n<p>&nbsp;</p>\r\n<div class=\"part_box clearfix\" sizset=\"37\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"37\" sizcache=\"39\">商品展示</h4>\r\n<dl class=\"ass_share_dl2 clearfix\" sizset=\"40\" sizcache=\"17\">\r\n<p sizset=\"40\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/11658/g/1380360375507.jpg\" alt=\"\" /></p>\r\n<p>&nbsp;</p>\r\n<p sizset=\"41\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/11658/g/1380360382403.jpg\" alt=\"\" /></p>\r\n<p>&nbsp;</p>\r\n<p sizset=\"42\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/11658/g/1380360388443.jpg\" alt=\"\" /></p>\r\n</dl></div>\r\n<p>&nbsp;</p>\r\n<div class=\"part_box clearfix\" sizset=\"38\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"38\" sizcache=\"39\">品牌文化</h4>\r\n<p>&nbsp;</p>\r\n<table width=\"780\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" sizset=\"43\" sizcache=\"17\">\r\n    <tbody sizset=\"43\" sizcache=\"17\">\r\n        <tr sizset=\"43\" sizcache=\"17\">\r\n            <td sizset=\"43\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/142/b/1351507215903.jpg\" alt=\"\" /></td>\r\n            <td>\r\n            <p><font color=\"#666666\" size=\"2\">从汉代的&ldquo;枸酱酒&rdquo;到宋代的&ldquo;凤曲法酒&rdquo;，从&ldquo;回沙工艺&rdquo;到&ldquo;盘勾勾兑&rdquo;，郎酒人恪守古训，传承1000多年的酿造古法，形成了&ldquo;高温制曲、两次投粮、凉堂堆积、回沙发酵、九次蒸酿、八次发酵、七次取酒、经年洞藏、盘勾勾兑&rdquo;的独特工艺。</font></p>\r\n            <p><font color=\"#666666\" size=\"2\">储藏郎酒的天宝洞、地宝洞面积近1.42万平方米，是当今世界最大的天然白酒酒库。冬暖夏凉，常年保持摄氏19度的恒温。在洞内藏酒，有利于酒体醇化。挥发的酒分子，附着在洞壁上，日积月累，已形成了厚厚的酒苔。这不仅有利于酒菌的繁衍生息，更可以使新酒的醇化老熟加快。经研究证明的：白酒的储藏期越长，酒中的有害物质越少，酒更加醇香，也更宜于人体健。  </font></p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n</div>\r\n<p>&nbsp;</p>\r\n<div class=\"part_box clearfix\" sizset=\"39\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"39\" sizcache=\"39\">酒厂介绍</h4>\r\n<div sizset=\"44\" sizcache=\"17\" style=\"margin: 0px; padding: 0px; width: 442px; height: 461px; color: rgb(60, 62, 61); line-height: 28px; font-family: 宋体, Verdana, Arial; font-size: 15px; float: left;\">\r\n<div sizset=\"44\" sizcache=\"17\" style=\"margin: 0px; padding: 20px 0px 0px; width: 442px; line-height: 24px; font-size: 14px;\"><font color=\"#666666\" size=\"2\">四川古蔺县是闻名遐迩的&ldquo;郎酒之乡&rdquo;。人们常说：&ldquo;名酒产地必有佳泉&rdquo;。凡是名酒，总  是同甘水佳泉密切联系的。古蔺郎酒的正宗产地是古蔺县二郎滩镇，此镇地处赤水河中游，四周  崇山峻岭。就在这高山深谷中有一清泉流出，泉水清澈，味甜，人们称它为&ldquo;郎泉&rdquo;。因取郎泉 之水酿酒，故名&ldquo;郎酒&rdquo;。 </font>\r\n<p style=\"margin: 0px; padding: 0px;\"><font color=\"#666666\" size=\"2\">古蔺郎酒有一百多年的酿造史，据有关资料记载，清朝末年，当地百姓发现郎泉适宜酿酒，  开始以小曲酿制出小曲酒和花香酒，供应当地居民饮用。1932年，由小曲改用大曲酿酒，取名&ldquo;  四沙郎酒&rdquo;，酒质尤佳。郎酒的特点为：&ldquo;山泉酿酒，深洞贮藏；泉甘酒洌，洞出奇香。 &rdquo;</font></p>\r\n<p sizset=\"44\" sizcache=\"17\" style=\"margin: 0px; padding: 0px;\"><img alt=\"\" src=\"http://img01.jiuxian.com/images/upload/Image/002(9).jpg\" style=\"margin: 0px; padding: 0px; border-image: initial;\" /></p>\r\n</div>\r\n<div sizset=\"45\" sizcache=\"17\" style=\"margin: 0px; padding: 0px; width: 442px;\"><img width=\"0\" height=\"0\" alt=\"\" src=\"http://img01.jiuxian.com/images/upload/Image/002(9).jpg\" border=\"0\" style=\"margin: 0px; padding: 0px; border-image: initial;\" /></div>\r\n</div>\r\n<div sizset=\"46\" sizcache=\"17\" style=\"margin: 0px; padding: 0px; width: 308px; color: rgb(60, 62, 61); line-height: 28px; font-family: 宋体, Verdana, Arial; font-size: 15px; float: left;\"><img width=\"308\" height=\"458\" alt=\"\" src=\"http://img01.jiuxian.com/images/upload/Image/langjiu001.jpg\" style=\"margin: 0px; padding: 0px; border-image: initial;\" /></div>\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(60, 62, 61); line-height: 28px; font-family: 宋体, Verdana, Arial; font-size: 14px;\">&nbsp;</p>\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(60, 62, 61); line-height: 28px; font-family: 宋体, Verdana, Arial; font-size: 14px;\">&nbsp;</p>\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(60, 62, 61); line-height: 28px; font-family: 宋体, Verdana, Arial; font-size: 14px;\">&nbsp;</p>\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(60, 62, 61); line-height: 28px; font-family: 宋体, Verdana, Arial; font-size: 14px;\">&nbsp;</p>\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(60, 62, 61); line-height: 28px; font-family: 宋体, Verdana, Arial; font-size: 14px;\">&nbsp;</p>\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(60, 62, 61); line-height: 28px; font-family: 宋体, Verdana, Arial; font-size: 14px;\">&nbsp;</p>\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(60, 62, 61); line-height: 28px; font-family: 宋体, Verdana, Arial; font-size: 14px;\">&nbsp;</p>\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(60, 62, 61); line-height: 28px; font-family: 宋体, Verdana, Arial; font-size: 14px;\">&nbsp;</p>\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(60, 62, 61); line-height: 28px; font-family: 宋体, Verdana, Arial; font-size: 14px;\">&nbsp;</p>\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(60, 62, 61); line-height: 28px; font-family: 宋体, Verdana, Arial; font-size: 14px;\">&nbsp;</p>\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(60, 62, 61); line-height: 28px; font-family: 宋体, Verdana, Arial; font-size: 14px;\">&nbsp;</p>\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(60, 62, 61); line-height: 28px; font-family: 宋体, Verdana, Arial; font-size: 14px;\">&nbsp;</p>\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(60, 62, 61); line-height: 28px; font-family: 宋体, Verdana, Arial; font-size: 14px;\">&nbsp;</p>\r\n<p sizset=\"47\" sizcache=\"17\" style=\"margin: 0px; padding: 0px; color: rgb(60, 62, 61); line-height: 28px; font-family: 宋体, Verdana, Arial; font-size: 14px;\"><img src=\"http://img01.jiuxian.com/upload/goods/3031/m/1366081969574.jpg\" alt=\"\" /></p>\r\n<p sizset=\"48\" sizcache=\"17\" style=\"margin: 0px; padding: 0px; color: rgb(60, 62, 61); line-height: 28px; font-family: 宋体, Verdana, Arial; font-size: 14px;\"><img src=\"http://img01.jiuxian.com/upload/goods/3031/m/1366081946594.jpg\" alt=\"\" /></p>\r\n</div>\r\n<p>&nbsp;</p>\r\n<div class=\"part_box clearfix\" sizset=\"40\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"40\" sizcache=\"39\">获奖荣誉</h4>\r\n<p><font color=\"#666666\" size=\"2\">1963年 郎酒获首届四川省名酒评比金奖。　</font></p>\r\n<p><font color=\"#666666\" size=\"2\">1979年 郎酒获国家质量优质奖。　</font></p>\r\n<p><font color=\"#666666\" size=\"2\">1985年 郎酒获中华人民共和国商业部&ldquo;金爵奖&rdquo;。　</font></p>\r\n<p><font color=\"#666666\" size=\"2\">1994年 郎酒在全国名酒行业中率先通过国际质量认证。　</font></p>\r\n<p><font color=\"#666666\" size=\"2\">1996年 郎酒在全国名酒厂中首家获得绿色食品标志使用权。　</font></p>\r\n<p><font color=\"#666666\" size=\"2\">1997年  &ldquo;郎&rdquo;牌商标被国家工商局认定为&ldquo;中国驰名商标&rdquo;，享受世界范围的特别保护。　</font></p>\r\n<p><font color=\"#666666\" size=\"2\">2000年 &ldquo;郎&rdquo;牌12年特醇郎酒被列为中国名酒极品。　</font></p>\r\n<p><font color=\"#666666\" size=\"2\">2001年  &ldquo;郎&rdquo;牌天宝洞藏酒被中国食品工业协会评为&ldquo;中国白酒著名创新品牌&rdquo;。　</font></p>\r\n<p><font color=\"#666666\" size=\"2\">2006年 郎酒获国家纯粮固态发酵白酒认证标志。　</font></p>\r\n<p><font color=\"#666666\" size=\"2\">2008年 &ldquo;古蔺郎酒传统酿制工艺&rdquo;列入&ldquo;国家非物质文化遗产&rdquo;保护名录。　</font></p>\r\n<p><font color=\"#666666\" size=\"2\">2009年  郎酒以87.79亿元的品牌价值入选《中国500最具价值品牌》，全国排名75位，白酒行业第3位</font></p>\r\n<p sizset=\"49\" sizcache=\"17\"><font color=\"#666666\" size=\"2\" sizset=\"49\" sizcache=\"17\"><img width=\"734\" height=\"107\" alt=\"\" src=\"http://img01.jiuxian.com/images/upload/Image/sss_logo.jpg\" style=\"margin: 0px; padding: 0px; border-image: initial;\" /></font></p>\r\n<p>&nbsp;</p>\r\n</div>\r\n<p><input id=\"sych\" type=\"hidden\" value=\"商务用酒;礼节拜访;聚会用酒;婚庆用酒\" /></p>\r\n<div class=\"part_box clearfix\" sizset=\"41\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"41\" sizcache=\"39\">适宜场合</h4>\r\n<div class=\"sych\" sizset=\"52\" sizcache=\"27\">\r\n<div class=\"sych1\" id=\"gvsw0\" sizset=\"52\" sizcache=\"27\"><span sizset=\"50\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvsw1.gif\" alt=\"\" /> </span><span sizset=\"51\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvhq1.gif\" alt=\"\" /> </span><span sizset=\"52\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvlj1.gif\" alt=\"\" /> </span><span sizset=\"53\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvjh1.gif\" alt=\"\" /></span></div>\r\n</div>\r\n</div>', 'images/201404/thumb_img/446_thumb_G_1398125234923.jpg', 'images/201404/goods_img/446_G_1398125234176.jpg', 'images/201404/source_img/446_G_1398125234110.jpg', '1', '', '1', '1', '0', '1398125234', '100', '0', '0', '0', '0', '0', '0', '1398125234', '0', '', '-1', '-1', '0', '', '0');
