align=\"center\">&nbsp;</p>\r\n<p align=\"center\" sizset=\"41\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/7860/g/1371202815362.jpg\" alt=\"\" /></p>\r\n<p align=\"center\">&nbsp;</p>\r\n<p align=\"center\" sizset=\"42\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/7860/g/1371202829205.jpg\" alt=\"\" /></p>\r\n</dl><!--detail_prtpic over--></div>\r\n<!--part_box over-->\r\n<div class=\"part_box clearfix\" sizset=\"38\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"38\" sizcache=\"39\">品牌文化</h4>\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"780\" sizset=\"43\" sizcache=\"17\">\r\n    <tbody sizset=\"43\" sizcache=\"17\">\r\n        <tr sizset=\"43\" sizcache=\"17\">\r\n            <td sizset=\"43\" sizcache=\"17\">\r\n            <p sizset=\"43\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/7860/b/1371204386528.jpg\" alt=\"\" /></p>\r\n            <p>&nbsp;</p>\r\n            </td>\r\n            <td>&nbsp;</td>\r\n            <td><font color=\"#666666\" size=\"2\">古井贡酒有着悠久的历史。南北朝时，在亳州的减店集，人们发现有一口古井，井水清洌甜美，人们用此井水酿酒、泡茶，回味无穷。相传，有个将军因作战失利，临死前将所用的兵器投入井里。谁知此后井水比先前更清淳透明，爽口润喉，所酿之酒，十里飘香，古井名声大噪，人们称之为&ldquo;天下名井&rdquo;。据史书记载，古井贡酒的前身是&ldquo;九酝春酒&rdquo;，为曹操令手下人酿造。后曹操将&ldquo;九酝春酒&rdquo;及酿酒方法&ldquo;九酝酒法&rdquo;献给汉献帝刘协，献帝大加赞赏，作为宫廷用酒。</font></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"780\" sizset=\"44\" sizcache=\"17\">\r\n    <tbody sizset=\"44\" sizcache=\"17\">\r\n        <tr sizset=\"44\" sizcache=\"17\">\r\n            <td sizset=\"44\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/7860/b/1371204391694.jpg\" alt=\"\" /></td>\r\n            <td>&nbsp;</td>\r\n            <td><font color=\"#666666\" size=\"2\">从此，亳州一带酿酒作坊如雨后春笋发展起来。到了宋代，减店集已成了有名的产酒地，当地百姓至今还有&ldquo;涡水鳜鱼苏水鲤，胡芹减酒宴贵宾&rdquo;的说法。明代万历年间，阁老沈鲤在万历帝的庆典上，把&ldquo;减酒&rdquo;当作家乡酒进贡朝廷，万历帝饮后连连叫好，钦定此酒为贡品，命其年年进贡，&ldquo;贡酒&rdquo;之名由此而得。</font></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</div>\r\n<!--part_box over-->\r\n<div class=\"part_box clearfix\" sizset=\"39\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"39\" sizcache=\"39\">酒厂介绍</h4>\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"780\" sizset=\"45\" sizcache=\"17\">\r\n    <tbody sizset=\"45\" sizcache=\"17\">\r\n        <tr sizset=\"45\" sizcache=\"17\">\r\n            <td sizset=\"45\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/7860/m/1371204615702.jpg\" alt=\"\" /></td>\r\n            <td>&nbsp;</td>\r\n            <td><font color=\"#666666\" size=\"2\">古井集团是中国老八大名酒企业，是中国第一家同时发行A、B两支股票的白酒类上市公司安徽古井贡酒股份有限公司的母公司，坐落在历史名人曹操与华佗故里――安徽省亳州市。公司的前身为起源于明代正德十年（公元1515年）的公兴槽坊，1959年转制为省营亳县古井酒厂。目前公司拥有员工8000多名，集酒业、酒店业、农产品深加工、房地产业等为一体，是国家大型一档企业。在2010年第二届中国酒类品牌价值评议活动中，古井贡以81.72亿元喜摘&ldquo;中华白酒十大全球代表性品牌&rdquo;，同时古井集团被授予&ldquo;中国白酒申请国家暨世界非物质文化遗产发起人&rdquo;。</font></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</div>\r\n<!--part_box over-->\r\n<div class=\"part_box clearfix\" sizset=\"40\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"40\" sizcache=\"39\">获奖荣誉</h4>\r\n<p><font color=\"#666666\" size=\"2\">1963年古井贡酒在第二届全国评酒会上首次被评为八大名酒，名列第二；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">1979、1984年，在第三、四届全国评酒会上，古井贡酒再次被评为国家名酒； </font></p>\r\n<p><font color=\"#666666\" size=\"2\">1988年l0月，在巴黎举办的第十三届国际食品博览会上，古井贡酒获金夏尔奖，是本届唯&mdash;获奖的中国名酒； </font></p>\r\n<p><font color=\"#666666\" size=\"2\">1989年12月，古井首次进入按利税排序的中国500家最大工业企业行列，成为共和国经济大厦的柱石；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">1989年在第五届全国评酒会上，古井贡酒实现金牌&ldquo;四联冠&rdquo;；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">1991年5月，古井牌古井特曲被国家轻工部评为&ldquo;全国轻工业优质产品&rdquo;。 </font></p>\r\n</div>\r\n<p><!--part_box--><!--part_box--><!-- 酒具适用场合 start--><!-- 酒具适用场合 end--><!--part_box--><input id=\"sych\" type=\"hidden\" value=\"商务用酒;礼节拜访;聚会用酒\" /></p>\r\n<div class=\"part_box clearfix\" sizset=\"41\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"41\" sizcache=\"39\">适宜场合</h4>\r\n<div class=\"sych\" sizset=\"54\" sizcache=\"27\">\r\n<div id=\"gvsw0\" class=\"sych1\" sizset=\"54\" sizcache=\"27\"><span sizset=\"46\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvsw1.gif\" alt=\"\" /> </span><span sizset=\"47\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvhq0.gif\" alt=\"\" /> </span><span sizset=\"48\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvlj1.gif\" alt=\"\" /> </span><span sizset=\"49\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvjh1.gif\" alt=\"\" /> </span></div>\r\n</div>\r\n</div>', 'images/201404/thumb_img/455_thumb_G_1398125743002.jpg', 'images/201404/goods_img/455_G_1398125743116.jpg', 'images/201404/source_img/455_G_1398125743665.jpg', '1', '', '1', '1', '3', '1398125743', '100', '0', '0', '0', '0', '0', '0', '1398125743', '0', '', '-1', '-1', '0', '', '0');
INSERT INTO `jindong_goods` ( `goods_id`, `cat_id`, `goods_sn`, `goods_name`, `goods_name_style`, `click_count`, `brand_id`, `provider_name`, `goods_number`, `goods_weight`, `market_price`, `shop_price`, `promote_price`, `promote_start_date`, `promote_end_date`, `warn_number`, `keywords`, `goods_brief`, `goods_desc`, `goods_thumb`, `goods_img`, `original_img`, `is_real`, `extension_code`, `is_on_sale`, `is_alone_sale`, `integral`, `add_time`, `sort_order`, `is_delete`, `is_best`, `is_new`, `is_hot`, `is_promote`, `bonus_type_id`, `last_update`, `goods_type`, `seller_note`, `give_integral`, `rank_integral`, `suppliers_id`, `is_check`, `is_shipping` ) VALUES  ('456', '717', 'ECS000456', '52°洋河蓝色经典梦之蓝M3 500ml', '+', '0', '192', '', '1', '0.000', '798.00', '599.00', '0.00', '0', '0', '1', '', '', '<h4 class=\"h4_ass\" sizset=\"36\" sizcache=\"39\">商品特点</h4>\r\n<p>&nbsp;</p>\r\n<dl class=\"ass_share_dl2 clearfix\" sizset=\"38\" sizcache=\"17\">\r\n<p sizset=\"38\" sizcache=\"17\"><strong><font color=\"#ff0000\">温馨提示：洋河系列产品新旧包装更替中，随机发货，请以收到的实物为准，给您带来的不便敬请谅解！</font></strong></p>\r\n<table width=\"780\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" sizset=\"38\" sizcache=\"17\">\r\n    <tbody sizset=\"38\" sizcache=\"17\">\r\n        <tr sizset=\"38\" sizcache=\"17\">\r\n            <td sizset=\"38\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/4081/f/1352170482651.jpg\" alt=\"\" /></td>\r\n            <td><font color=\"#666666\" size=\"2\"><strong><font color=\"#333333\">●  清丽脱俗，水晶之梦：</font></strong>M3整理灵感源自多姿多彩的自然世界，以艺术手法演绎世间千万美态，展现精巧细致的工艺与文化魅力，梦想在现实中，栩栩如生，清丽脱俗。梦之蓝M3盒型承袭了5A级梦之蓝的纯正血统，勾勒了一个&ldquo;水晶之梦：，精致的吊牌装饰，系于瓶身，衬托出了整体气质,梦之蓝M3整理晶莹剔透、优雅华丽，仿佛像是梦境之中的美景。 </font></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p sizset=\"39\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/4081/f/1352543861847.jpg\" alt=\"\" /></p>\r\n</dl>\r\n<p>&nbsp;</p>\r\n<div class=\"part_box clearfix\" sizset=\"37\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"37\" sizcache=\"39\">商品展示</h4>\r\n<dl class=\"ass_share_dl2 clearfix\" sizset=\"40\" sizcache=\"17\">\r\n<p align=\"center\" sizset=\"40\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/4081/g/1352170095771.jpg\" alt=\"\" /></p>\r\n<p align=\"center\">&nbsp;</p>\r\n<p align=\"center\" sizset=\"41\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/4081/g/1352170098801.jpg\" alt=\"\" /></p>\r\n<p align=\"center\" sizset=\"42\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/4081/g/1352170103614.jpg\" alt=\"\" /></p>\r\n</dl></div>\r\n<p>&nbsp;</p>\r\n<div class=\"part_box clearfix\" sizset=\"38\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"38\" sizcache=\"39\">品牌文化</h4>\r\n<table width=\"780\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" sizset=\"43\" sizcache=\"17\">\r\n    <tbody sizset=\"43\" sizcache=\"17\">\r\n        <tr sizset=\"43\" sizcache=\"17\">\r\n            <td sizset=\"43\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/4390/b/1351838154484.jpg\" alt=\"\" /></td>\r\n            <td><font color=\"#666666\" size=\"2\">据传，洋河大曲在唐代就已享盛名，尚可考证的历史已有四百多年，明末清初已闻名遐迩。当时曾有九个省的客商在此设立会馆，省内外七十多位商人客籍于此，竞酿美酒，使洋河镇的酿酒业更加兴隆繁盛。据《泗阳县志》记载，明朝著名诗人邹辑在《咏白洋河》中写到：&ldquo;白洋河下春水碧，白洋河中多沽客，春风二月柳条新，却念行人千里隔，行客年年任往来，居人自在洋河曲&rdquo;。清雍正年间，洋河大曲已行销江淮一带，颇受欢迎，有&ldquo;福泉酒海清香美，味占江淮第一家&rdquo;之誉，并被列为清皇室贡品。据记载，清乾隆皇帝第二次南巡时，在宿迁建有行宫，留住七天，品尝洋河大曲后挥毫留下了&ldquo;酒味香醇，真佳酒也&rdquo;的赞语。</font></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</div>\r\n<p>&nbsp;</p>\r\n<div class=\"part_box clearfix\" sizset=\"39\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"39\" sizcache=\"39\">酒厂介绍</h4>\r\n<p sizset=\"44\" sizcache=\"17\">&nbsp;</p>\r\n<table width=\"780\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" sizset=\"44\" sizcache=\"17\">\r\n    <tbody sizset=\"44\" sizcache=\"17\">\r\n        <tr sizset=\"44\" sizcache=\"17\">\r\n            <td sizset=\"44\" sizcache=\"17\">\r\n            <p sizset=\"44\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/4390/m/1351837996758.jpg\" alt=\"\" /></p>\r\n            <p>&nbsp;</p>\r\n            </td>\r\n            <td>\r\n            <p><font color=\"#666666\" size=\"2\">江苏洋河酒厂股份有限公司位于苏北古镇&mdash;&mdash;洋河，面临徐淮公路，背靠京杭运河，交通畅达，酒业兴旺。洋河大曲以产地而得名，系以优质高粱为原料，以小麦、大麦、豌豆制成的高温火曲为发酵剂，辅以闻名遐迩的美人泉水精工酿制而成。</font></p>\r\n            <p>&nbsp;</p>\r\n            </td>\r\n        </tr>\r\n        <tr sizset=\"45\" sizcache=\"17\">\r\n            <td sizset=\"45\" sizcache=\"17\">\r\n            <p sizset=\"45\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/4390/m/1351838160770.jpg\" alt=\"\" /></p>\r\n            <p>&nbsp;</p>\r\n            </td>\r\n            <td>\r\n            <p><font color=\"#666666\" size=\"2\">企业在全国同行率先通过包括ISO9001质量认证、ISO14001环境管理体系认证、OHSAS18001职业健康安全管理体系和ISO22000食品安全管理体系认证，较早成立省级企业技术中心，被国家、省授予博士后技术创新中心称号。正是以雄厚的技术创新优势和质量管理优势，洋河酒厂参与起草了浓香型白酒国家新标准，江苏省生物酿酒技术研究院也落户洋河。特别是2003年以来，洋河酒厂成功打造&ldquo;绵柔型&rdquo;白酒经典之作洋河蓝色经典，在白酒市场掀起&ldquo;蓝色风暴&rdquo;，并成为备受行业关注的成功营销范例，企业销售连续多年保持50%以上增幅。 </font></p>\r\n            <p>&nbsp;</p>\r\n            </td>\r\n        </tr>\r\n        <tr sizset=\"46\" sizcache=\"17\">\r\n            <td sizset=\"46\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/4390/m/1351838242895.jpg\" alt=\"\" /></td>\r\n            <td>\r\n            <p><font color=\"#666666\" size=\"2\">近年来，洋河全力打造&ldquo;绵柔型&rdquo;白酒经典之作&mdash;&mdash;洋河蓝色经典。世界上最宽广的是海，比海更高远的是天空，比天空更博大的是男人的情怀。蓝色是开放的象征，是时尚的标志，是现代的感觉，是品位的表现；天之高为蓝，海之深为蓝，梦之遥为蓝，这是对洋河蓝色文化的一种演绎，体现了人们对宽广、博大胸怀的追求。</font></p>\r\n            <p>&nbsp;</p>\r\n            <p>&nbsp;</p>\r\n            <p>&nbsp;</p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n</div>\r\n<p>&nbsp;</p>\r\n<div class=\"part_box clearfix\" sizset=\"40\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"40\" sizcache=\"39\">获奖荣誉</h4>\r\n<p><font color=\"#666666\" size=\"2\">2005年 消费者最爱品牌；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">2005年 食品安全认证。</font></p>\r\n<p sizset=\"47\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/4081/h/1389608085933.jpg\" alt=\"\" /></p>\r\n</div>\r\n<p><input id=\"sych\" type=\"hidden\" value=\"商务用酒;婚庆用酒;礼节拜访\" /></p>\r\n<div class=\"part_box clearfix\" sizset=\"41\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"41\" sizcache=\"39\">适宜场合</h4>\r\n<div class=\"sych\" sizset=\"56\" sizcache=\"27\">\r\n<div class=\"sych1\" id=\"gvsw0\" sizset=\"56\" sizcache=\"27\"><span sizset=\"48\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvsw1.gif\" alt=\"\" /> </span><span sizset=\"49\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvhq1.gif\" alt=\"\" /> </span><span sizset=\"50\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvlj1.gif\" alt=\"\" /> </span><span sizset=\"51\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvjh0.gif\" alt=\"\" /></span></div>\r\n</div>\r\n</div>\r\n<p>&nbsp;</p>', 'images/201404/thumb_img/456_thumb_G_1398125755300.jpg', 'images/201404/goods_img/456_G_1398125755449.jpg', 'images/201404/source_img/456_G_1398125755040.jpg', '1', '', '1', '1', '5', '1398125755', '100', '0', '0', '0', '0', '0', '0', '1398125755', '0', '', '-1', '-1', '0', '', '0');
INSERT INTO `jindong_goods` ( `goods_id`, `cat_id`, `goods_sn`, `goods_name`, `goods_name_style`, `click_count`, `brand_id`, `provider_name`, `goods_number`, `goods_weight`, `market_price`, `shop_price`, `promote_price`, `promote_start_date`, `promote_end_date`, `warn_number`, `keywords`, `goods_brief`, `goods_desc`, `goods_thumb`, `goods_img`, `original_img`, `is_real`, `extension_code`, `is_on_sale`, `is_alone_sale`, `integral`, `add_time`, `sort_order`, `is_delete`, `is_best`, `is_new`, `is_hot`, `is_promote`, `bonus_type_id`, `last_update`, `goods_type`, `seller_note`, `give_integral`, `rank_integral`, `suppliers_id`, `is_check`, `is_shipping` ) VALUES  ('457', '883', 'ECS000457', '45°古井御藏御之藏500ml', '+', '0', '200', '', '1', '0.000', '598.80', '499.00', '0.00', '0', '0', '1', '', '', '<p>商品特点</p>\r\n<dl class=\"ass_share_dl2 clearfix\" sizset=\"39\" sizcache=\"17\">\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"780\" sizset=\"39\" sizcache=\"17\">\r\n    <tbody sizset=\"39\" sizcache=\"17\">\r\n        <tr sizset=\"39\" sizcache=\"17\">\r\n            <td sizset=\"39\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/7861/f/1371267754321.jpg\" alt=\"\" /></td>\r\n            <td>&nbsp;</td>\r\n            <td>\r\n            <p><font color=\"#333333\" size=\"2\"><strong>御用藏品 名仕荣耀</strong></font></p>\r\n            <p><font color=\"#666666\" size=\"2\">古井御藏御之藏，采用帝王黄瓷，彰显尊贵品质。御之藏酿造水源取自千年古井下的地下水、性温、质清。酒曲采用桃花盛开时，所制春曲，以汉代秘制酒法酿造，并以古法藏之，以皇家御品为品质标准，也表达了一种内敛低调的处世之道，宣扬藏而不露亦锋芒的智者风范展露无疑。</font></p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</dl><!--part_box over-->\r\n<div class=\"part_box clearfix\" sizset=\"37\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"37\" sizcache=\"39\">商品展示</h4>\r\n<dl class=\"ass_share_dl2 clearfix\" sizset=\"40\" sizcache=\"17\">\r\n<p align=\"center\">&nbsp;</p>\r\n<p align=\"center\" sizset=\"40\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/7861/g/1371267700370.jpg\" alt=\"\" /></p>\r\n<p align=\"center\">&nbsp;</p>\r\n<p align=\"center\" sizset=\"41\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/7861/g/1371267719633.jpg\" alt=\"\" /></p>\r\n<p align=\"center\">&nbsp;</p>\r\n<p align=\"center\" sizset=\"42\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/7861/g/1371267725455.jpg\" alt=\"\" /></p>\r\n</dl><!--detail_prtpic over--></div>\r\n<!--part_box over-->\r\n<div class=\"part_box clearfix\" sizset=\"38\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"38\" sizcache=\"39\">品牌文化</h4>\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"780\" sizset=\"43\" sizcache=\"17\">\r\n    <tbody sizset=\"43\" sizcache=\"17\">\r\n        <tr sizset=\"43\" sizcache=\"17\">\r\n            <td sizset=\"43\" sizcache=\"17\">\r\n            <p sizset=\"43\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/7860/b/1371204386528.jpg\" alt=\"\" /></p>\r\n            <p>&nbsp;</p>\r\n            </td>\r\n            <td>&nbsp;</td>\r\n            <td><font color=\"#666666\" size=\"2\">古井贡酒有着悠久的历史。南北朝时，在亳州的减店集，人们发现有一口古井，井水清洌甜美，人们用此井水酿酒、泡茶，回味无穷。相传，有个将军因作战失利，临死前将所用的兵器投入井里。谁知此后井水比先前更清淳透明，爽口润喉，所酿之酒，十里飘香，古井名声大噪，人们称之为&ldquo;天下名井&rdquo;。据史书记载，古井贡酒的前身是&ldquo;九酝春酒&rdquo;，为曹操令手下人酿造。后曹操将&ldquo;九酝春酒&rdquo;及酿酒方法&ldquo;九酝酒法&rdquo;献给汉献帝刘协，献帝大加赞赏，作为宫廷用酒。</font></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"780\" sizset=\"44\" sizcache=\"17\">\r\n    <tbody sizset=\"44\" sizcache=\"17\">\r\n        <tr sizset=\"44\" sizcache=\"17\">\r\n            <td sizset=\"44\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/7860/b/1371204391694.jpg\" alt=\"\" /></td>\r\n            <td>&nbsp;</td>\r\n            <td><font color=\"#666666\" size=\"2\">从此，亳州一带酿酒作坊如雨后春笋发展起来。到了宋代，减店集已成了有名的产酒地，当地百姓至今还有&ldquo;涡水鳜鱼苏水鲤，胡芹减酒宴贵宾&rdquo;的说法。明代万历年间，阁老沈鲤在万历帝的庆典上，把&ldquo;减酒&rdquo;当作家乡酒进贡朝廷，万历帝饮后连连叫好，钦定此酒为贡品，命其年年进贡，&ldquo;贡酒&rdquo;之名由此而得。</font></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</div>\r\n<!--part_box over-->\r\n<div class=\"part_box clearfix\" sizset=\"39\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"39\" sizcache=\"39\">酒厂介绍</h4>\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"780\" sizset=\"45\" sizcache=\"17\">\r\n    <tbody sizset=\"45\" sizcache=\"17\">\r\n        <tr sizset=\"45\" sizcache=\"17\">\r\n            <td sizset=\"45\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/7860/m/1371204615702.jpg\" alt=\"\" /></td>\r\n            <td>&nbsp;</td>\r\n            <td><font color=\"#666666\" size=\"2\">古井集团是中国老八大名酒企业，是中国第一家同时发行A、B两支股票的白酒类上市公司安徽古井贡酒股份有限公司的母公司，坐落在历史名人曹操与华佗故里――安徽省亳州市。公司的前身为起源于明代正德十年（公元1515年）的公兴槽坊，1959年转制为省营亳县古井酒厂。目前公司拥有员工8000多名，集酒业、酒店业、农产品深加工、房地产业等为一体，是国家大型一档企业。在2010年第二届中国酒类品牌价值评议活动中，古井贡以81.72亿元喜摘&ldquo;中华白酒十大全球代表性品牌&rdquo;，同时古井集团被授予&ldquo;中国白酒申请国家暨世界非物质文化遗产发起人&rdquo;。</font></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</div>\r\n<!--part_box over-->\r\n<div class=\"part_box clearfix\" sizset=\"40\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"40\" sizcache=\"39\">获奖荣誉</h4>\r\n<p><font color=\"#666666\" size=\"2\">1963年古井贡酒在第二届全国评酒会上首次被评为八大名酒，名列第二；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">1979、1984年，在第三、四届全国评酒会上，古井贡酒再次被评为国家名酒； </font></p>\r\n<p><font color=\"#666666\" size=\"2\">1988年l0月，在巴黎举办的第十三届国际食品博览会上，古井贡酒获金夏尔奖，是本届唯&mdash;获奖的中国名酒； </font></p>\r\n<p><font color=\"#666666\" size=\"2\">1989年12月，古井首次进入按利税排序的中国500家最大工业企业行列，成为共和国经济大厦的柱石；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">1989年在第五届全国评酒会上，古井贡酒实现金牌&ldquo;四联冠&rdquo;；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">1991年5月，古井牌古井特曲被国家轻工部评为&ldquo;全国轻工业优质产品&rdquo;。 </font></p>\r\n</div>\r\n<p><!--part_box--><!--part_box--><!-- 酒具适用场合 start--><!-- 酒具适用场合 end--><!--part_box--><input id=\"sych\" type=\"hidden\" value=\"商务用酒;礼节拜访;聚会用酒\" /></p>\r\n<div class=\"part_box clearfix\" sizset=\"0\" sizcache=\"2890\">\r\n<h4 class=\"h4_ass\" sizset=\"41\" sizcache=\"39\">适宜场合</h4>\r\n<div class=\"sych\" sizset=\"0\" sizcache=\"2890\">\r\n<div id=\"gvsw0\" class=\"sych1\" sizset=\"0\" sizcache=\"2890\"><span sizset=\"46\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvsw1.gif\" alt=\"\" /> </span><span sizset=\"47\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvhq0.gif\" alt=\"\" /> </span><span sizset=\"48\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvlj1.gif\" alt=\"\" /> </span><span sizset=\"49\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvjh1.gif\" alt=\"\" /> </span></div>\r\n</div>\r\n</div>', 'images/201404/thumb_img/457_thumb_G_1398125840360.jpg', 'images/201404/goods_img/457_G_1398125840835.jpg', 'images/201404/source_img/457_G_1398125840180.jpg', '1', '', '1', '1', '4', '1398125840', '100', '0', '0', '0', '0', '0', '0', '1398125840', '0', '', '-1', '-1', '0', '', '0');
INSERT INTO `jindong_goods` ( `goods_id`, `cat_id`, `goods_sn`, `goods_name`, `goods_name_style`, `click_count`, `brand_id`, `provider_name`, `goods_number`, `goods_weight`, `market_price`, `shop_price`, `promote_price`, `promote_start_date`, `promote_end_date`, `warn_number`, `keywords`, `goods_brief`, `goods_desc`, `goods_thumb`, `goods_img`, `original_img`, `is_real`, `extension_code`, `is_on_sale`, `is_alone_sale`, `integral`, `add_time`, `sort_order`, `is_delete`, `is_best`, `is_new`, `is_hot`, `is_promote`, `bonus_type_id`, `last_update`, `goods_type`, `seller_note`, `give_integral`, `rank_integral`, `suppliers_id`, `is_check`, `is_shipping` ) VALUES  ('458', '717', 'ECS000458', '46°洋河蓝色经典天之蓝480ml', '+', '0', '192', '', '1', '0.000', '616.00', '329.00', '0.00', '0', '0', '1', '', '', '<h4 class=\"h4_ass\" sizset=\"36\" sizcache=\"39\">商品特点</h4>\r\n<p>&nbsp;</p>\r\n<dl class=\"ass_share_dl2 clearfix\" sizset=\"39\" sizcache=\"17\">\r\n<p sizset=\"39\" sizcache=\"17\"><strong><font color=\"#ff0000\">温馨提示：洋河系列产品新旧包装更替中，随机发货，请以收到的实物为准，给您带来的不便敬请谅解！</font></strong></p>\r\n<table width=\"780\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" sizset=\"39\" sizcache=\"17\">\r\n    <tbody sizset=\"39\" sizcache=\"17\">\r\n        <tr sizset=\"39\" sizcache=\"17\">\r\n            <td sizset=\"39\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/313/f/1376898953739.jpg\" alt=\"\" /></td>\r\n            <td><font color=\"#666666\" size=\"2\"><strong><font color=\"#333333\">●  蓝色经典，男人情怀：</font></strong>世界上最宽广的是海，比大海更远的是天空，比天空更广阔的是男人的情怀，蓝色文化体现着新时代的民族精神，像海一样具有宽广而博大的胸怀，像浪花一样充满竞争和创造力量，海至深为蓝，天至高为蓝，梦之遥为蓝，火至精纯为蓝，蓝色正是我们时代呼唤生命的律动色彩。洋河蓝色经典天之蓝这一独特的蓝色包装宛如一飞舞的蓝色精灵，瞬间抓住了所有人的眼球，天之蓝的温婉儒雅、落落大方，犹如一窈窕淑女，必定会君子好逑。 </font></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p align=\"center\" sizset=\"40\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/313/f/1352543981601.jpg\" alt=\"\" /></p>\r\n</dl>\r\n<p>&nbsp;</p>\r\n<div class=\"part_box clearfix\" sizset=\"37\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"37\" sizcache=\"39\">商品展示</h4>\r\n<dl class=\"ass_share_dl2 clearfix\" sizset=\"41\" sizcache=\"17\">\r\n<p sizset=\"41\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/313/g/1376899025695.jpg\" alt=\"\" /></p>\r\n<p>&nbsp;</p>\r\n<p sizset=\"42\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/313/g/1376899031615.jpg\" alt=\"\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p sizset=\"43\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/313/g/1376899037700.jpg\" alt=\"\" /></p>\r\n</dl></div>\r\n<p>&nbsp;</p>\r\n<div class=\"part_box clearfix\" sizset=\"38\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"38\" sizcache=\"39\">品牌文化</h4>\r\n<table width=\"780\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" sizset=\"44\" sizcache=\"17\">\r\n    <tbody sizset=\"44\" sizcache=\"17\">\r\n        <tr sizset=\"44\" sizcache=\"17\">\r\n            <td sizset=\"44\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/4390/b/1351838154484.jpg\" alt=\"\" /></td>\r\n            <td><font color=\"#666666\" size=\"2\">据传，洋河大曲在唐代就已享盛名，尚可考证的历史已有四百多年，明末清初已闻名遐迩。当时曾有九个省的客商在此设立会馆，省内外七十多位商人客籍于此，竞酿美酒，使洋河镇的酿酒业更加兴隆繁盛。据《泗阳县志》记载，明朝著名诗人邹辑在《咏白洋河》中写到：&ldquo;白洋河下春水碧，白洋河中多沽客，春风二月柳条新，却念行人千里隔，行客年年任往来，居人自在洋河曲&rdquo;。清雍正年间，洋河大曲已行销江淮一带，颇受欢迎，有&ldquo;福泉酒海清香美，味占江淮第一家&rdquo;之誉，并被列为清皇室贡品。据记载，清乾隆皇帝第二次南巡时，在宿迁建有行宫，留住七天，品尝洋河大曲后挥毫留下了&ldquo;酒味香醇，真佳酒也&rdquo;的赞语。</font></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</div>\r\n<p>&nbsp;</p>\r\n<div class=\"part_box clearfix\" sizset=\"39\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"39\" sizcache=\"39\">酒厂介绍</h4>\r\n<p sizset=\"45\" sizcache=\"17\">&nbsp;</p>\r\n<table width=\"780\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" sizset=\"45\" sizcache=\"17\">\r\n    <tbody sizset=\"45\" sizcache=\"17\">\r\n        <tr sizset=\"45\" sizcache=\"17\">\r\n            <td sizset=\"45\" sizcache=\"17\">\r\n            <p sizset=\"45\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/4390/m/1351837996758.jpg\" alt=\"\" /></p>\r\n            <p>&nbsp;</p>\r\n            </td>\r\n            <td>\r\n            <p><font color=\"#666666\" size=\"2\">江苏洋河酒厂股份有限公司位于苏北古镇&mdash;&mdash;洋河，面临徐淮公路，背靠京杭运河，交通畅达，酒业兴旺。洋河大曲以产地而得名，系以优质高粱为原料，以小麦、大麦、豌豆制成的高温火曲为发酵剂，辅以闻名遐迩的美人泉水精工酿制而成。</font></p>\r\n            <p>&nbsp;</p>\r\n            </td>\r\n        </tr>\r\n        <tr sizset=\"46\" sizcache=\"17\">\r\n            <td sizset=\"46\" sizcache=\"17\">\r\n            <p sizset=\"46\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/4390/m/1351838160770.jpg\" alt=\"\" /></p>\r\n            <p>&nbsp;</p>\r\n            </td>\r\n            <td>\r\n            <p><font color=\"#666666\" size=\"2\">企业在全国同行率先通过包括ISO9001质量认证、ISO14001环境管理体系认证、OHSAS18001职业健康安全管理体系和ISO22000食品安全管理体系认证，较早成立省级企业技术中心，被国家、省授予博士后技术创新中心称号。正是以雄厚的技术创新优势和质量管理优势，洋河酒厂参与起草了浓香型白酒国家新标准，江苏省生物酿酒技术研究院也落户洋河。特别是2003年以来，洋河酒厂成功打造&ldquo;绵柔型&rdquo;白酒经典之作洋河蓝色经典，在白酒市场掀起&ldquo;蓝色风暴&rdquo;，并成为备受行业关注的成功营销范例，企业销售连续多年保持50%以上增幅。 </font></p>\r\n            <p>&nbsp;</p>\r\n            </td>\r\n        </tr>\r\n        <tr sizset=\"47\" sizcache=\"17\">\r\n            <td sizset=\"47\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/4390/m/1351838242895.jpg\" alt=\"\" /></td>\r\n            <td>\r\n            <p><font color=\"#666666\" size=\"2\">近年来，洋河全力打造&ldquo;绵柔型&rdquo;白酒经典之作&mdash;&mdash;洋河蓝色经典。世界上最宽广的是海，比海更高远的是天空，比天空更博大的是男人的情怀。蓝色是开放的象征，是时尚的标志，是现代的感觉，是品位的表现；天之高为蓝，海之深为蓝，梦之遥为蓝，这是对洋河蓝色文化的一种演绎，体现了人们对宽广、博大胸怀的追求。</font></p>\r\n            <p>&nbsp;</p>\r\n            <p>&nbsp;</p>\r\n            <p>&nbsp;</p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n</div>\r\n<p>&nbsp;</p>\r\n<div class=\"part_box clearfix\" sizset=\"40\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"40\" sizcache=\"39\">获奖荣誉</h4>\r\n<p><font color=\"#666666\" size=\"2\">2005年 消费者最爱品牌；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">2005年 食品安全认证。</font></p>\r\n</div>\r\n<p><input id=\"sych\" type=\"hidden\" value=\"商务用酒;婚庆用酒;礼节拜访;聚会用酒\" /></p>\r\n<div class=\"part_box clearfix\" sizset=\"41\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"41\" sizcache=\"39\">适宜场合</h4>\r\n<div class=\"sych\" sizset=\"55\" sizcache=\"27\">\r\n<div class=\"sych1\" id=\"gvsw0\" sizset=\"55\" sizcache=\"27\"><span sizset=\"48\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvsw1.gif\" alt=\"\" /> </span><span sizset=\"49\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvhq1.gif\" alt=\"\" /> </span><span sizset=\"50\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvlj1.gif\" alt=\"\" /> </span><span sizset=\"51\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvjh1.gif\" alt=\"\" /></span></div>\r\n</div>\r\n</div>', 'images/201404/thumb_img/458_thumb_G_1398125850510.jpg', 'images/201404/goods_img/458_G_1398125850780.jpg', 'images/201404/source_img/458_G_1398125850456.jpg', '1', '', '1', '1', '3', '1398125850', '100', '0', '0', '0', '0', '0', '0', '1398125850', '0', '', '-1', '-1', '0', '', '0');
