\n            <p>&nbsp;</p>\r\n            </td>\r\n            <td>\r\n            <p><font color=\"#666666\" size=\"2\">江苏洋河酒厂股份有限公司位于苏北古镇&mdash;&mdash;洋河，面临徐淮公路，背靠京杭运河，交通畅达，酒业兴旺。洋河大曲以产地而得名，系以优质高粱为原料，以小麦、大麦、豌豆制成的高温火曲为发酵剂，辅以闻名遐迩的美人泉水精工酿制而成。</font></p>\r\n            <p>&nbsp;</p>\r\n            </td>\r\n        </tr>\r\n        <tr sizset=\"45\" sizcache=\"17\">\r\n            <td sizset=\"45\" sizcache=\"17\">\r\n            <p sizset=\"45\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/4390/m/1351838160770.jpg\" alt=\"\" /></p>\r\n            <p>&nbsp;</p>\r\n            </td>\r\n            <td>\r\n            <p><font color=\"#666666\" size=\"2\">企业在全国同行率先通过包括ISO9001质量认证、ISO14001环境管理体系认证、OHSAS18001职业健康安全管理体系和ISO22000食品安全管理体系认证，较早成立省级企业技术中心，被国家、省授予博士后技术创新中心称号。正是以雄厚的技术创新优势和质量管理优势，洋河酒厂参与起草了浓香型白酒国家新标准，江苏省生物酿酒技术研究院也落户洋河。特别是2003年以来，洋河酒厂成功打造&ldquo;绵柔型&rdquo;白酒经典之作洋河蓝色经典，在白酒市场掀起&ldquo;蓝色风暴&rdquo;，并成为备受行业关注的成功营销范例，企业销售连续多年保持50%以上增幅。 </font></p>\r\n            <p>&nbsp;</p>\r\n            </td>\r\n        </tr>\r\n        <tr sizset=\"46\" sizcache=\"17\">\r\n            <td sizset=\"46\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/4390/m/1351838242895.jpg\" alt=\"\" /></td>\r\n            <td>\r\n            <p><font color=\"#666666\" size=\"2\">近年来，洋河全力打造&ldquo;绵柔型&rdquo;白酒经典之作&mdash;&mdash;洋河蓝色经典。世界上最宽广的是海，比海更高远的是天空，比天空更博大的是男人的情怀。蓝色是开放的象征，是时尚的标志，是现代的感觉，是品位的表现；天之高为蓝，海之深为蓝，梦之遥为蓝，这是对洋河蓝色文化的一种演绎，体现了人们对宽广、博大胸怀的追求。</font></p>\r\n            <p>&nbsp;</p>\r\n            <p>&nbsp;</p>\r\n            <p>&nbsp;</p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n</div>\r\n<p>&nbsp;</p>\r\n<div class=\"part_box clearfix\" sizset=\"40\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"40\" sizcache=\"39\">获奖荣誉</h4>\r\n<p><font color=\"#666666\" size=\"2\">2005年 消费者最爱品牌；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">2005年 食品安全认证。</font></p>\r\n</div>\r\n<p><input id=\"sych\" type=\"hidden\" value=\"聚会用酒\" /></p>\r\n<div class=\"part_box clearfix\" sizset=\"41\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"41\" sizcache=\"39\">适宜场合</h4>\r\n<div class=\"sych\" sizset=\"54\" sizcache=\"27\">\r\n<div class=\"sych1\" id=\"gvsw0\" sizset=\"54\" sizcache=\"27\"><span sizset=\"47\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvsw0.gif\" alt=\"\" /> </span><span sizset=\"48\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvhq0.gif\" alt=\"\" /> </span><span sizset=\"49\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvlj0.gif\" alt=\"\" /> </span><span sizset=\"50\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvjh1.gif\" alt=\"\" /> </span></div>\r\n</div>\r\n</div>', 'images/201404/thumb_img/461_thumb_G_1398126173755.jpg', 'images/201404/goods_img/461_G_1398126173186.jpg', 'images/201404/source_img/461_G_1398126173614.jpg', '1', '', '1', '1', '0', '1398126173', '100', '0', '0', '0', '0', '0', '0', '1398126173', '0', '', '-1', '-1', '0', '', '0');
