r\n            </td>\r\n            <td><img class=\"err-product\" alt=\"\" src=\"http://bcs.baidu.com/weigou-prodb-image/product_desc_181397382_78923_1.jpg\" /></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<div class=\"formwork_bt\">\r\n<div class=\"formwork_bt_rb\"><span>产品特色 </span><span class=\"s2\">Selling Point </span></div>\r\n</div>\r\n<div class=\"formwork\">\r\n<div class=\"formwork_img\"><img class=\"err-product\" alt=\"\" src=\"http://bcs.baidu.com/weigou-prodb-image/product_desc_181397382_78923_2.jpg\" /></div>\r\n</div>\r\n<div class=\"formwork\">\r\n<div class=\"formwork_text\">贵董酒，纯粮固态发酵，不含酒精勾兑，国密品质保证！</div>\r\n</div>\r\n<div class=\"formwork\">\r\n<div class=\"formwork_text\">贵董酒，酒体纯净通透，董香曲雅舒适，入口特别棉柔顺滑，饮后甘爽醇厚，回味悠长，适度饮用让人全身舒坦！</div>\r\n</div>\r\n<div class=\"formwork\">\r\n<div class=\"formwork_text\">贵董酒，记录历史，见证传奇，映射着许多人的深情厚谊，彰显贵董独有的风采，以心款待众人厚爱！</div>\r\n</div>\r\n<div class=\"formwork\">\r\n<div class=\"formwork_text\">贵董酒，绝版出售，珍贵收藏！</div>\r\n</div>\r\n<div class=\"formwork\">\r\n<div class=\"formwork_img\"><img class=\"err-product\" alt=\"\" src=\"http://bcs.baidu.com/weigou-prodb-image/product_desc_181397382_78923_3.jpg\" /></div>\r\n</div>\r\n<div class=\"formwork\">\r\n<div class=\"formwork_img\"><img class=\"err-product\" alt=\"\" src=\"http://bcs.baidu.com/weigou-prodb-image/product_desc_181397382_78923_4.jpg\" /></div>\r\n</div>\r\n<div class=\"formwork\">\r\n<div class=\"formwork_img\"><img class=\"err-product\" alt=\"\" src=\"http://bcs.baidu.com/weigou-prodb-image/product_desc_181397382_78923_5.jpg\" /></div>\r\n</div>\r\n<div class=\"formwork_bt\">\r\n<div class=\"formwork_bt_rb\"><span>品牌荣誉 </span><span class=\"s2\">Brand Awards </span></div>\r\n</div>\r\n<div class=\"formwork\">\r\n<div class=\"formwork_img\"><img class=\"err-product\" alt=\"\" src=\"http://bcs.baidu.com/weigou-prodb-image/product_desc_181397382_78923_6.png\" /></div>\r\n</div>\r\n<div class=\"formwork\">\r\n<div class=\"formwork_img\"><img class=\"err-product\" alt=\"\" src=\"http://bcs.baidu.com/weigou-prodb-image/product_desc_181397382_78923_7.png\" /></div>\r\n</div>\r\n<div class=\"formwork\">\r\n<div class=\"formwork_tpl_left1\">\r\n<div class=\"formwork_tp1_img\"><img class=\"err-product\" alt=\"\" src=\"http://bcs.baidu.com/weigou-prodb-image/product_desc_181397382_78923_8.jpg\" /></div>\r\n<p class=\"formwork_title1\">1983年被认定为密级机密</p>\r\n</div>\r\n<div class=\"formwork_tpl_left1\">\r\n<div class=\"formwork_tp1_img\"><img class=\"err-product\" alt=\"\" src=\"http://bcs.baidu.com/weigou-prodb-image/product_desc_181397382_78923_9.jpg\" /></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<p>&nbsp;</p>', 'images/201404/thumb_img/466_thumb_G_1398126695772.jpg', 'images/201404/goods_img/466_G_1398126695527.jpg', 'images/201404/source_img/466_G_1398126695962.jpg', '1', '', '1', '1', '0', '1398126695', '100', '0', '0', '0', '0', '0', '0', '1398126695', '0', '', '-1', '-1', '0', '', '0');
