th=\"750\" align=\"center\">\r\n    <tbody>\r\n        <tr>\r\n            <td>\r\n            <p class=\"formwork_titleleft\">红色经典54度500ml</p>\r\n            <p class=\"formwork_titleleft2\">香型：董香型 <br />\r\n            酒精度：54%vol <br />\r\n            净含量：500ml <br />\r\n            产地：贵州遵义 <br />\r\n            原料：水、高粱、小麦、大米 <br />\r\n            储存条件：通风、干燥、清洁、常温</p>\r\n            </td>\r\n            <td><img class=\"err-product\" alt=\"\" src=\"http://bcs.baidu.com/weigou-prodb-image/product_desc_181594390_310529_2.jpg\" /></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</p>\r\n<div class=\"formwork_bt\">\r\n<div class=\"formwork_bt_rb\"><span>产品特色 </span><span class=\"s2\">Selling Point </span></div>\r\n</div>\r\n<div class=\"formwork\">\r\n<div class=\"formwork_img\"><img class=\"err-product\" alt=\"\" src=\"http://bcs.baidu.com/weigou-prodb-image/product_desc_181594390_310529_3.jpg\" /></div>\r\n</div>\r\n<div class=\"formwork\">\r\n<div class=\"formwork_img\"><img class=\"err-product\" alt=\"\" src=\"http://bcs.baidu.com/weigou-prodb-image/product_desc_181594390_310529_4.jpg\" /></div>\r\n</div>\r\n<div class=\"formwork\">\r\n<div class=\"formwork_img\"><img class=\"err-product\" alt=\"\" src=\"http://bcs.baidu.com/weigou-prodb-image/product_desc_181594390_310529_5.jpg\" /></div>\r\n</div>\r\n<div class=\"formwork_bt\">\r\n<div class=\"formwork_bt_rb\"><span>品牌荣誉 </span><span class=\"s2\">Brand Awards </span></div>\r\n</div>\r\n<div class=\"formwork\">\r\n<div class=\"formwork_img\"><img class=\"err-product\" alt=\"\" src=\"http://bcs.baidu.com/weigou-prodb-image/product_desc_181594390_310529_6.png\" /></div>\r\n</div>\r\n<div class=\"formwork\">\r\n<div class=\"formwork_img\"><img class=\"err-product\" alt=\"\" src=\"http://bcs.baidu.com/weigou-prodb-image/product_desc_181594390_310529_7.png\" /></div>\r\n</div>\r\n<div class=\"formwork\">\r\n<div class=\"formwork_tpl_left1\">\r\n<div class=\"formwork_tp1_img\"><img class=\"err-product\" alt=\"\" sr