INSERT INTO `jindong_goods` ( `goods_id`, `cat_id`, `goods_sn`, `goods_name`, `goods_name_style`, `click_count`, `brand_id`, `provider_name`, `goods_number`, `goods_weight`, `market_price`, `shop_price`, `promote_price`, `promote_start_date`, `promote_end_date`, `warn_number`, `keywords`, `goods_brief`, `goods_desc`, `goods_thumb`, `goods_img`, `original_img`, `is_real`, `extension_code`, `is_on_sale`, `is_alone_sale`, `integral`, `add_time`, `sort_order`, `is_delete`, `is_best`, `is_new`, `is_hot`, `is_promote`, `bonus_type_id`, `last_update`, `goods_type`, `seller_note`, `give_integral`, `rank_integral`, `suppliers_id`, `is_check`, `is_shipping` ) VALUES  ('480', '877', 'ECS000480', '46°武陵芙蓉国色小酒100ml（3瓶套装）', '+', '0', '194', '', '1', '0.000', '84.00', '48.00', '0.00', '0', '0', '1', '', '', '<h4 class=\"h4_ass\" sizset=\"36\" sizcache=\"39\">商品特点</h4>\r\n<p>&nbsp;</p>\r\n<dl class=\"ass_share_dl2 clearfix\" sizset=\"36\" sizcache=\"17\">\r\n<table width=\"780\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" sizset=\"36\" sizcache=\"17\">\r\n    <tbody sizset=\"36\" sizcache=\"17\">\r\n        <tr sizset=\"36\" sizcache=\"17\">\r\n            <td sizset=\"36\" sizcache=\"17\"><img src=\"http://img10.jiuxian.com/bill/upload/goods/9254/f/1371890011136.jpg\" alt=\"\" /></td>\r\n            <td>&nbsp;</td>\r\n            <td>\r\n            <p><font color=\"#333333\" size=\"2\"><strong>品饮武陵芙蓉 引人无限遐想</strong></font></p>\r\n            <p><font color=\"#666666\" size=\"2\">芙蓉国色小酒，流线型瓶身如清水芙蓉娇小，却身着一片深邃蓝，尽显幽雅气度，深远而高贵，小小的瓶子装满浓浓的醇香，口感细腻，酒香四溢，香气缭绕。深邃的蓝色与绵长的香味给人无限的遐想，值得细细品味。</font></p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</dl>\r\n<p>&nbsp;</p>\r\n<div class=\"part_box clearfix\" sizset=\"37\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"37\" sizcache=\"39\">商品展示</h4>\r\n<dl class=\"ass_share_dl2 clearfix\" sizset=\"37\" sizcache=\"17\">\r\n<p sizset=\"37\" sizcache=\"17\"><img src=\"http://img10.jiuxian.com/bill/upload/goods/9254/g/1371890099704.jpg\" alt=\"\" /></p>\r\n</dl></div>\r\n<p>&nbsp;</p>\r\n<div class=\"part_box clearfix\" sizset=\"38\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"38\" sizcache=\"39\">品牌文化</h4>\r\n<table width=\"780\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" sizset=\"38\" sizcache=\"17\" style=\"color: rgb(60, 62, 61); line-height: 28px; font-family: 宋体, Verdana, Arial; font-size: 14px; border-collapse: collapse; -webkit-border-horizontal-spacing: 0px; -webkit-border-vertical-spacing: 0px;\">\r\n    <tbody sizset=\"38\" sizcache=\"17\">\r\n        <tr sizset=\"38\" sizcache=\"17\">\r\n            <td sizset=\"38\" sizcache=\"17\" style=\"margin: 0px; padding: 0px;\"><img src=\"http://img10.jiuxian.com/bill/upload/goods/4419/b/1351766924287.jpg\" alt=\"\" /></td>\r\n            <td style=\"margin: 0px; padding: 0px;\"><font color=\"#666666\" size=\"2\">中国十七大名酒之一、酱香型三大名酒之一、中国驰名商标品牌、湖南省唯一的中国名酒&middot;武陵酒，历史渊远流长，源自唐宋时期盛极一时的崔婆酒。1952年，武陵酒公司的前身&mdash;&mdash;原常德市酒厂在崔婆酒酿造的旧酒坊上建成，1972年武陵酒的工程师在学习传统酱香白酒酿造工艺的基础上，自主创新研制出风格独特的幽雅酱香武陵酒，1989年在全国第五届评酒会上，与茅台、泸州老窖等一起荣获中国名酒称号并获得国家质量金奖，从此结束了湖南省没有&ldquo;中国名酒&rdquo;的历史。</font></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</div>\r\n<p>&nbsp;</p>\r\n<div class=\"part_box clearfix\" sizset=\"39\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"39\" sizcache=\"39\">酒厂介绍</h4>\r\n<p>&nbsp;</p>\r\n<table width=\"780\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" sizset=\"39\" sizcache=\"17\">\r\n    <tbody sizset=\"39\" sizcache=\"17\">\r\n        <tr sizset=\"39\" sizcache=\"17\">\r\n            <td sizset=\"39\" sizcache=\"17\">\r\n            <p sizset=\"39\" sizcache=\"17\"><img src=\"http://img10.jiuxian.com/bill/upload/goods/4419/m/1351766822855.jpg\" alt=\"\" /></p>\r\n            <p>&nbsp;</p>\r\n            </td>\r\n            <td>\r\n            <p><font color=\"#666666\" size=\"2\">湖南武陵酒有限公司，坐落于风景秀丽的常德德山，厂区总建筑面积46000㎡，现有员工600余人，国家级品酒师、省级品酒师、高级酿酒师等各类专业技术人员80余人。历经半个多世纪的发展，已成为一家集产品系列化、包装系列化和生产标准化的大型酒类生产企业，确立了&ldquo;一体两翼&rdquo;的多品牌战略发展规划，产品主要有酱香武陵酒&mdash;武陵上酱、武陵中酱、武陵少酱，浓香型武陵洞庭春色系列，兼香型武陵芙蓉国色系列，涵盖酱香、浓香、兼香三大领域。</font></p>\r\n            </td>\r\n        </tr>\r\n        <tr sizset=\"40\" sizcache=\"17\">\r\n            <td sizset=\"40\" sizcache=\"17\"><img src=\"http://img10.jiuxian.com/bill/upload/goods/4419/m/1351766845318.jpg\" alt=\"\" /></td>\r\n            <td>\r\n            <p><font color=\"#666666\" size=\"2\">为了谋求更大的发展空间，2004年，&ldquo;浓香鼻祖&rdquo;泸州老窖入主湖南武陵酒有限公司，两大名酒强强联手，共同打造&ldquo;中国名酒&middot;酱香武陵&rdquo;。2010年9月，公司投资6.5亿元，在常德国家经济技术开发区征地1000亩新建万吨酱酒新基地，打造一流的生态工业园。2010年，武陵酒代表湘酒独家入驻上海世博会；2011年5月，中国名酒&middot;武陵酒荣获中国驰名商标。武陵酒的快速发展吸引着资本市场的高度关注，2011年6月18日，世界500强企业&mdash;&mdash;联想控股入主湖南武陵酒有限公司，重点围绕武陵酒&ldquo;千亩万吨酱酒百亿产值&rdquo;的目标，加快实现武陵酒的跨越式发展。  </font></p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</div>\r\n<p>&nbsp;</p>\r\n<div class=\"part_box clearfix\" sizset=\"40\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"40\" sizcache=\"39\">获奖荣誉</h4>\r\n<p><font color=\"#666666\" size=\"2\">1973年，武陵酒被赋予为湖南省名酒称号；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">1979年，在全国第三届评酒会上武陵酒荣获国家优质酒称号及银质奖；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">1984年，在全国第四届评酒会上武陵酒荣获国家优质酒称号及银质奖；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">1990年，48&deg;武陵酒获首届轻工业博览会金奖；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">1991年，武陵酒荣获第二届北京国际博览会金奖；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">1992年，在美国纽约首届国际白酒、葡萄酒、饮料博览会上武陵酒荣获中国名优酒博览会金奖；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">1997年，武陵酒被中国名牌产品工作委员会认定为中国名牌产品；&ldquo;武陵&rdquo;被省工商局认定为省著名商标；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">2001年，武陵酒获省名牌产品称号；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">2004年，武陵酒获省行业优质产品称号；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">2008年，53&deg;武陵少酱、中酱、上酱酒和52&deg;洞庭春色酒荣获2008年度湖南省酿酒行业优质产品称号；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">2008年，武陵酒荣获中国湘菜馆最受欢迎的十大酒水；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">2009年，武陵酒荣获湖南省著名商标；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">2009年，武陵酒有限公司荣获常德市消费者信得过单位称号；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">2010年，武陵酒代表湘酒独家入驻上海世博会；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">2011年，武陵酒荣获中国驰名商标。</font></p>\r\n</div>\r\n<p><input id=\"sych\" type=\"hidden\" value=\"聚会用酒\" /></p>\r\n<div class=\"part_box clearfix\" sizset=\"41\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"41\" sizcache=\"39\">适宜场合</h4>\r\n<div class=\"sych\" sizset=\"55\" sizcache=\"27\">\r\n<div class=\"sych1\" id=\"gvsw0\" sizset=\"55\" sizcache=\"27\"><span sizset=\"41\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvsw0.gif\" alt=\"\" /> </span><span sizset=\"42\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvhq0.gif\" alt=\"\" /> </span><span sizset=\"43\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvlj0.gif\" alt=\"\" /> </span><span sizset=\"44\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvjh1.gif\" alt=\"\" /></span></div>\r\n</div>\r\n</div>', 'images/201404/thumb_img/480_thumb_G_1398127407243.jpg', 'images/201404/goods_img/480_G_1398127407196.jpg', 'images/201404/source_img/480_G_1398127407746.jpg', '1', '', '1', '1', '0', '1398127407', '100', '0', '0', '0', '0', '0', '0', '1398127407', '0', '', '-1', '-1', '0', '', '0');
INSERT INTO `jindong_goods` ( `goods_id`, `cat_id`, `goods_sn`, `goods_name`, `goods_name_style`, `click_count`, `brand_id`, `provider_name`, `goods_number`, `goods_weight`, `market_price`, `shop_price`, `promote_price`, `promote_start_date`, `promote_end_date`, `warn_number`, `keywords`, `goods_brief`, `goods_desc`, `goods_thumb`, `goods_img`, `original_img`, `is_real`, `extension_code`, `is_on_sale`, `is_alone_sale`, `integral`, `add_time`, `sort_order`, `is_delete`, `is_best`, `is_new`, `is_hot`, `is_promote`, `bonus_type_id`, `last_update`, `goods_type`, `seller_note`, `give_integral`, `rank_integral`, `suppliers_id`, `is_check`, `is_shipping` ) VALUES  ('481', '884', 'ECS000481', '董酒紫运54度 500ml', '+', '0', '201', '', '1', '0.000', '420.00', '350.00', '0.00', '0', '0', '1', '', '', '<p><img class=\"err-product\" alt=\"\" src=\"http://bcs.baidu.com/weigou-prodb-image/product_desc_181594401_285996_0.jpg\" /></p>\r\n<div class=\"formwork_bt\">\r\n<div class=\"formwork_bt_rb\"><span>品牌介绍 </span><span class=\"s2\">Brand Introduction </span></div>\r\n</div>\r\n<div class=\"formwork\">\r\n<div class=\"formwork_text\">董酒，产于中国优质 <span id=\"wiki-keyword-0\" class=\"wiki-words\" data-id=\"781\" style=\"border-bottom: 1px dotted; padding-bottom: 2px\">白酒 </span>核 心区&mdash;&mdash;贵州遵义，是中国老八大名酒，贵州省仅有的两大国家名酒之一。它是历传承着中国传统文化深厚根基的民族瑰宝，是承袭中国数千年酿酒文化脉络的真正 活化石，代表了中华民族千年沉淀的中医养生文化，它是中国白酒行业中极具中华民族特色的传统产品。 董酒独特酿造配方源于道光年间，是建国后三次被列为 &ldquo;国家秘密技术&rdquo;的中国传统八大名酒。是串香工艺的鼻祖，其独特工艺简称为&ldquo;两小、两大、双醅串香&rdquo;，经过分级陈酿，科学勾兑，形成特殊的董香风格&mdash;&mdash;酒 液清澈透明，香气幽雅舒适，入口醇和浓郁，饮后甘爽味长。</div>\r\n</div>\r\n<div class=\"formwork\">\r\n<div class=\"formwork_img\"><img class=\"err-product\" alt=\"\" src=\"http://bcs.baidu.com/weigou-prodb-image/product_desc_181594401_285996_1.jpg\" /></div>\r\n</div>\r\n<div class=\"formwork_bt\">\r\n<div class=\"formwork_bt_rb\"><span>产品信息 </span><span class=\"s2\">Product Information </span></div>\r\n</div>\r\n<p>\r\n<table border=\"0\" cellspacing=\"6\" cellpadding=\"0\" width=\"750\" align=\"center\">\r\n    <tbody>\r\n        <tr>\r\n            <td>\r\n            <p class=\"formwork_titleleft\">紫运董酒54&deg;</p>\r\n            <p class=\"formwork_titleleft2\">香型：董香型 <br />\r\n            酒精度：54%vol <br />\r\n            净含量：500ml <br />\r\n            产地：贵州遵义 <br />\r\n            原料：水、高粱、小麦、大米 <br />\r\n            储存条件：通风、干燥、清洁、常温</p>\r\n            </td>\r\n            <td><img class=\"err-product\" alt=\"\" src=\"http://bcs.baidu.com/weigou-prodb-image/product_desc_181594401_285996_2.jpg\" /></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</p>\r\n<div class=\"formwork_bt\">\r\n<div class=\"formwork_bt_rb\"><span>产品特色 </span><span class=\"s2\">Selling Point </span></div>\r\n</div>\r\n<div class=\"formwork\">\r\n<div class=\"formwork_img\"><img class=\"err-product\" alt=\"\" src=\"http://bcs.baidu.com/weigou-prodb-image/product_desc_181594401_285996_3.jpg\" /></div>\r\n</div>\r\n<div class=\"formwork\">\r\n<div class=\"formwork_img\"><img class=\"err-product\" alt=\"\" src=\"http://bcs.baidu.com/weigou-prodb-image/product_desc_181594401_285996_4.jpg\" /></div>\r\n</div>\r\n<div class=\"formwork\">\r\n<div class=\"formwork_img\"><img class=\"err-product\" alt=\"\" src=\"http://bcs.baidu.com/weigou-prodb-image/product_desc_181594401_285996_5.jpg\" /></div>\r\n</div>\r\n<div class=\"formwork\">\r\n<div class=\"formwork_img\"><img class=\"err-product\" alt=\"\" src=\"http://bcs.baidu.com/weigou-prodb-image/product_desc_181594401_285996_6.jpg\" /></div>\r\n</div>\r\n<div class=\"formwork_bt\">\r\n<div class=\"formwork_bt_rb\"><span>品牌荣誉 </span><span class=\"s2\">Brand Awards </span></div>\r\n</div>\r\n<div class=\"formwork\">\r\n<div class=\"formwork_img\"><img class=\"err-product\" alt=\"\" src=\"http://bcs.baidu.com/weigou-prodb-image/product_desc_181594401_285996_7.png\" /></div>\r\n</div>\r\n<div class=\"formwork\">\r\n<div class=\"formwork_img\"><img class=\"err-product\" alt=\"\" src=\"http://bcs.baidu.com/weigou-prodb-image/product_desc_181594401_285996_8.png\" /></div>\r\n</div>\r\n<div class=\"formwork\">\r\n<div class=\"formwork_tpl_left1\">\r\n<div class=\"formwork_tp1_img\"><img class=\"err-product\" alt=\"\" src=\"http://bcs.baidu.com/weigou-prodb-image/product_desc_181594401_285996_9.jpg\" /></div>\r\n<p class=\"formwork_title1\">1983年被认定为密级机密</p>\r\n</div>\r\n<div class=\"formwork_tpl_left1\">\r\n<div class=\"formwork_tp1_img\"><img class=\"err-product\" alt=\"\" src=\"http://bcs.baidu.com/weigou-prodb-image/product_desc_181594401_285996_10.jpg\" /></div>\r\n</div>\r\n</div>', 'images/201404/thumb_img/481_thumb_G_1398127459383.jpg', 'images/201404/goods_img/481_G_1398127459526.jpg', 'images/201404/source_img/481_G_1398127459390.jpg', '1', '', '1', '1', '3', '1398127459', '100', '0', '0', '0', '0', '0', '0', '1398127459', '0', '', '-1', '-1', '0', '', '0');
INSERT INTO `jindong_goods` ( `goods_id`, `cat_id`, `goods_sn`, `goods_name`, `goods_name_style`, `click_count`, `brand_id`, `provider_name`, `goods_number`, `goods_weight`, `market_price`, `shop_price`, `promote_price`, `promote_start_date`, `promote_end_date`, `warn_number`, `keywords`, `goods_brief`, `goods_desc`, `goods_thumb`, `goods_img`, `original_img`, `is_real`, `extension_code`, `is_on_sale`, `is_alone_sale`, `integral`, `add_time`, `sort_order`, `is_delete`, `is_best`, `is_new`, `is_hot`, `is_promote`, `bonus_type_id`, `last_update`, `goods_type`, `seller_note`, `give_integral`, `rank_integral`, `suppliers_id`, `is_check`, `is_shipping` ) VALUES  ('482', '877', 'ECS000482', '52°武陵芙蓉国色6年500ml（2瓶套装）', '+', '0', '194', '', '1', '0.000', '376.00', '199.00', '0.00', '0', '0', '1', '', '', '<h4 class=\"h4_ass\" sizset=\"36\" sizcache=\"39\">商品特点</h4>\r\n<p>&nbsp;</p>\r\n<dl class=\"ass_share_dl2 clearfix\" sizset=\"36\" sizcache=\"17\">\r\n<table width=\"780\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" sizset=\"36\" sizcache=\"17\">\r\n    <tbody sizset=\"36\" sizcache=\"17\">\r\n        <tr sizset=\"36\" sizcache=\"17\">\r\n            <td sizset=\"36\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/9250/f/1371892897495.jpg\" alt=\"\" /></td>\r\n            <td>&nbsp;</td>\r\n            <td>\r\n            <p><strong><font color=\"#333333\" size=\"2\">酱香雅俗 共饮佳酿琼浆</font></strong></p>\r\n            <p><font color=\"#666666\" size=\"2\">沉寂六年始得名师垂青，经由酿酒名师精心勾调，绵厚甘甜，圆润恰长，酒香浓郁，火热凌人，芙蓉国色6年，红底白身的陶瓷瓶刻画出了优美的曲线，既典雅又喜庆，祥和气象自然流露，实为雅俗共赏的佳品。</font></p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</dl>\r\n<p>&nbsp;</p>\r\n<div class=\"part_box clearfix\" sizset=\"37\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"37\" sizcache=\"39\">商品展示</h4>\r\n<dl class=\"ass_share_dl2 clearfix\" sizset=\"37\" sizcache=\"17\">\r\n<p align=\"center\" sizset=\"37\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/9250/g/1371892907480.jpg\" alt=\"\" /></p>\r\n<p align=\"center\">&nbsp;</p>\r\n<p align=\"center\" sizset=\"38\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/9250/g/1371892912945.jpg\" alt=\"\" /></p>\r\n<p align=\"center\">&nbsp;</p>\r\n<p align=\"center\" sizset=\"39\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/9250/g/1371892918608.jpg\" alt=\"\" /></p>\r\n</dl></div>\r\n<p>&nbsp;</p>\r\n<div class=\"part_box clearfix\" sizset=\"38\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"38\" sizcache=\"39\">品牌文化</h4>\r\n<table width=\"780\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" sizset=\"40\" sizcache=\"17\" style=\"color: rgb(60, 62, 61); line-height: 28px; font-family: 宋体, Verdana, Arial; font-size: 14px; border-collapse: collapse; -webkit-border-horizontal-spacing: 0px; -webkit-border-vertical-spacing: 0px;\">\r\n    <tbody sizset=\"40\" sizcache=\"17\">\r\n        <tr sizset=\"40\" sizcache=\"17\">\r\n            <td sizset=\"40\" sizcache=\"17\" style=\"margin: 0px; padding: 0px;\"><img src=\"http://img01.jiuxian.com/upload/goods/4419/b/1351766924287.jpg\" alt=\"\" /></td>\r\n            <td style=\"margin: 0px; padding: 0px;\"><font color=\"#666666\" size=\"2\">中国十七大名酒之一、酱香型三大名酒之一、中国驰名商标品牌、湖南省唯一的中国名酒&middot;武陵酒，历史渊远流长，源自唐宋时期盛极一时的崔婆酒。1952年，武陵酒公司的前身&mdash;&mdash;原常德市酒厂在崔婆酒酿造的旧酒坊上建成，1972年武陵酒的工程师在学习传统酱香白酒酿造工艺的基础上，自主创新研制出风格独特的幽雅酱香武陵酒，1989年在全国第五届评酒会上，与茅台、泸州老窖等一起荣获中国名酒称号并获得国家质量金奖，从此结束了湖南省没有&ldquo;中国名酒&rdquo;的历史。</font></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</div>\r\n<p>&nbsp;</p>\r\n<div class=\"part_box clearfix\" sizset=\"39\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"39\" sizcache=\"39\">酒厂介绍</h4>\r\n<p sizset=\"41\" sizcache=\"17\">&nbsp;</p>\r\n<table width=\"780\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" sizset=\"41\" sizcache=\"17\">\r\n    <tbody sizset=\"41\" sizcache=\"17\">\r\n        <tr sizset=\"41\" sizcache=\"17\">\r\n            <td sizset=\"41\" sizcache=\"17\">\r\n            <p sizset=\"41\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/4419/m/1351766822855.jpg\" alt=\"\" /></p>\r\n            </td>\r\n            <td>\r\n            <p><font color=\"#666666\" size=\"2\">湖南武陵酒有限公司，坐落于风景秀丽的常德德山，厂区总建筑面积46000㎡，现有员工600余人，国家级品酒师、省级品酒师、高级酿酒师等各类专业技术人员80余人。历经半个多世纪的发展，已成为一家集产品系列化、包装系列化和生产标准化的大型酒类生产企业，确立了&ldquo;一体两翼&rdquo;的多品牌战略发展规划，产品主要有酱香武陵酒&mdash;武陵上酱、武陵中酱、武陵少酱，浓香型武陵洞庭春色系列，兼香型武陵芙蓉国色系列，涵盖酱香、浓香、兼香三大领域。</font></p>\r\n            </td>\r\n        </tr>\r\n        <tr sizset=\"42\" sizcache=\"17\">\r\n            <td sizset=\"42\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/4419/m/1351766845318.jpg\" alt=\"\" /></td>\r\n            <td>\r\n            <p><font color=\"#666666\" size=\"2\">为了谋求更大的发展空间，2004年，&ldquo;浓香鼻祖&rdquo;泸州老窖入主湖南武陵酒有限公司，两大名酒强强联手，共同打造&ldquo;中国名酒&middot;酱香武陵&rdquo;。2010年9月，公司投资6.5亿元，在常德国家经济技术开发区征地1000亩新建万吨酱酒新基地，打造一流的生态工业园。2011年5月，中国名酒&middot;武陵酒荣获中国驰名商标。武陵酒的快速发展吸引着资本市场的高度关注，2011年6月18日，世界500强企业&mdash;&mdash;联想控股入主湖南武陵酒有限公司，重点围绕武陵酒&ldquo;千亩万吨酱酒百亿产值&rdquo;的目标，加快实现武陵酒的跨越式发展。  </font></p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n</div>\r\n<p>&nbsp;</p>\r\n<div class=\"part_box clearfix\" sizset=\"40\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"40\" sizcache=\"39\">获奖荣誉</h4>\r\n<p><font color=\"#666666\" size=\"2\">1973年，武陵酒被赋予为湖南省名酒称号；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">1979年，在全国第三届评酒会上武陵酒荣获国家优质酒称号及银质奖；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">1984年，在全国第四届评酒会上武陵酒荣获国家优质酒称号及银质奖；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">1990年，48&deg;武陵酒获首届轻工业博览会金奖；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">1991年，武陵酒荣获第二届北京国际博览会金奖；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">1992年，在美国纽约首届国际白酒、葡萄酒、饮料博览会上武陵酒荣获中国名优酒博览会金奖；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">1997年，武陵酒被中国名牌产品工作委员会认定为中国名牌产品；&ldquo;武陵&rdquo;被省工商局认定为省著名商标；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">2001年，武陵酒获省名牌产品称号；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">2004年，武陵酒获省行业优质产品称号；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">2008年，53&deg;武陵少酱、中酱、上酱酒和52&deg;洞庭春色酒荣获2008年度湖南省酿酒行业优质产品称号；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">2008年，武陵酒荣获中国湘菜馆最受欢迎的十大酒水；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">2009年，武陵酒荣获湖南省著名商标；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">2009年，武陵酒有限公司荣获常德市消费者信得过单位称号；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">2011年，武陵酒荣获中国驰名商标。</font></p>\r\n</div>\r\n<p><input id=\"sych\" type=\"hidden\" value=\"礼节拜访;聚会用酒\" /></p>\r\n<div class=\"part_box clearfix\" sizset=\"41\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"41\" sizcache=\"39\">适宜场合</h4>\r\n<div class=\"sych\" sizset=\"54\" sizcache=\"27\">\r\n<div class=\"sych1\" id=\"gvsw0\" sizset=\"54\" sizcache=\"27\"><span sizset=\"43\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvsw0.gif\" alt=\"\" /> </span><span sizset=\"44\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvhq0.gif\" alt=\"\" /> </span><span sizset=\"45\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvlj1.gif\" alt=\"\" /> </span><span sizset=\"46\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvjh1.gif\" alt=\"\" /></span></div>\r\n</div>\r\n</div>', 'images/201404/thumb_img/482_thumb_G_1398127490580.jpg', 'images/201404/goods_img/482_G_1398127490057.jpg', 'images/201404/source_img/482_G_1398127490351.jpg', '1', '', '1', '1', '1', '1398127489', '100', '0', '0', '0', '0', '0', '0', '1398127489', '0', '', '-1', '-1', '0', '', '0');
