ll/2014/0417/f4ac755feec04627b62acc9d64e05c81.jpg\" alt=\"\" /></p>\r\n<p align=\"center\">&nbsp;</p>\r\n<p align=\"center\" sizset=\"41\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/9249/g/1371892254404.jpg\" alt=\"\" /></p>\r\n<p align=\"center\">&nbsp;</p>\r\n<p align=\"center\" sizset=\"42\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/9249/g/1371892258719.jpg\" alt=\"\" /></p>\r\n</dl></div>\r\n<p>&nbsp;</p>\r\n<div class=\"part_box clearfix\" sizset=\"38\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"38\" sizcache=\"39\">品牌文化</h4>\r\n<table width=\"780\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" sizset=\"43\" sizcache=\"17\" style=\"color: rgb(60, 62, 61); line-height: 28px; font-family: 宋体, Verdana, Arial; font-size: 14px; border-collapse: collapse; -webkit-border-horizontal-spacing: 0px; -webkit-border-vertical-spacing: 0px;\">\r\n    <tbody sizset=\"43\" sizcache=\"17\">\r\n        <tr sizset=\"43\" sizcache=\"17\">\r\n            <td sizset=\"43\" sizcache=\"17\" style=\"margin: 0px; padding: 0px;\"><img src=\"http://img01.jiuxian.com/upload/goods/4419/b/1351766924287.jpg\" alt=\"\" /></td>\r\n            <td style=\"margin: 0px; padding: 0px;\"><font color=\"#666666\" size=\"2\">中国十七大名酒之一、酱香型三大名酒之一、湖南省唯一的中国名酒&middot;武陵酒，历史渊远流长，源自唐宋时期盛极一时的崔婆酒。1952年，武陵酒公司的前身&mdash;&mdash;原常德市酒厂在崔婆酒酿造的旧酒坊上建成，1972年武陵酒的工程师在学习传统酱香白酒酿造工艺的基础上，自主创新研制出风格独特的幽雅酱香武陵酒，1989年在全国第五届评酒会上，与茅台、泸州老窖等一起荣获中国名酒称号并获得国家质量金奖，从此结束了湖南省没有&ldquo;中国名酒&rdquo;的历史。</font></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</div>\r\n<p>&nbsp;</p>\r\n<div class=\"part_box clearfix\" sizset=\"39\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"39\" sizcache=\"39\">酒厂介绍</h4>\r\n<p>&nbsp;</p>\r\n<table width=\"780\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" sizset=\"44\" sizcache=\"17\">\r\n    <tbody sizset=\"44\" sizcache=\"17\">\r\n        <tr sizset=\"44\" sizcache=\"17\">\r\n            <td sizset=\"44\" sizcache=\"17\">\r\n            <p sizset=\"44\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/4419/m/1351766822855.jpg\" alt=\"\" /></p>\r\n            <p>&nbsp;</p>\r\n            </td>\r\n            <td>\r\n            <p><font color=\"#666666\" size=\"2\">湖南武陵酒有限公司，坐落于风景秀丽的常德德山，厂区总建筑面积46000㎡，现有员工600余人，国家级品酒师、省级品酒师、高级酿酒师等各类专业技术人员80余人。历经半个多世纪的发展，已成为一家集产品系列化、包装系列化和生产标准化的大型酒类生产企业，确立了&ldquo;一体两翼&rdquo;的多品牌战略发展规划，产品主要有酱香武陵酒&mdash;武陵上酱、武陵中酱、武陵少酱，浓香型武陵洞庭春色系列，兼香型武陵芙蓉国色系列，涵盖酱香、浓香、兼香三大领域。</font></p>\r\n            </td>\r\n        </tr>\r\n        <tr sizset=\"45\" sizcache=\"17\">\r\n            <td sizset=\"45\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/4419/m/1351766845318.jpg\" alt=\"\" /></td>\r\n            <td>\r\n            <p><font color=\"#666666\" size=\"2\">为了谋求更大的发展空间，2004年，&ldquo;浓香鼻祖&rdquo;泸州老窖入主湖南武陵酒有限公司，两大名酒强强联手，共同打造&ldquo;中国名酒&middot;酱香武陵&rdquo;。2010年9月，公司投资6.5亿元，在常德国家经济技术开发区征地1000亩新建万吨酱酒新基地，打造一流的生态工业园。武陵酒的快速发展吸引着资本市场的高度关注，2011年6月18日，世界500强企业&mdash;&mdash;联想控股入主湖南武陵酒有限公司，重点围绕武陵酒&ldquo;千亩万吨酱酒百亿产值&rdquo;的目标，加快实现武陵酒的跨越式发展。  </font></p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</div>\r\n<p>&nbsp;</p>\r\n<div class=\"part_box clearfix\" sizset=\"40\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"40\" sizcache=\"39\">获奖荣誉</h4>\r\n<p><font color=\"#666666\" size=\"2\">1973年，武陵酒被赋予为湖南省名酒称号；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">1979年，在全国第三届评酒会上武陵酒荣获国家优质酒称号及银质奖；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">1984年，在全国第四届评酒会上武陵酒荣获国家优质酒称号及银质奖；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">1990年，48&deg;武陵酒获首届轻工业博览会金奖；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">1991年，武陵酒荣获第二届北京国际博览会金奖；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">1992年，在美国纽约首届国际白酒、葡萄酒、饮料博览会上武陵酒荣获中国名优酒博览会金奖；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">1997年，武陵酒被中国名牌产品工作委员会认定为中国名牌产品；&ldquo;武陵&rdquo;被省工商局认定为省著名商标；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">2001年，武陵酒获省名牌产品称号；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">2004年，武陵酒获省行业优质产品称号；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">2008年，53&deg;武陵少酱、中酱、上酱酒和52&deg;洞庭春色酒荣获2008年度湖南省酿酒行业优质产品称号；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">2008年，武陵酒荣获中国湘菜馆最受欢迎的十大酒水；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">2009年，武陵酒荣获湖南省著名商标；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">2009年，武陵酒有限公司荣获常德市消费者信得过单位称号。</font></p>\r\n</div>\r\n<p><input id=\"sych\" type=\"hidden\" value=\"商务用酒;礼节拜访;聚会用酒\" /></p>\r\n<div class=\"part_box clearfix\" sizset=\"41\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"41\" sizcache=\"39\">适宜场合</h4>\r\n<div class=\"sych\" sizset=\"54\" sizcache=\"27\">\r\n<div class=\"sych1\" id=\"gvsw0\" sizset=\"54\" sizcache=\"27\"><span sizset=\"46\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvsw1.gif\" alt=\"\" /> </span><span sizset=\"47\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvhq0.gif\" alt=\"\" /> </span><span sizset=\"48\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvlj1.gif\" alt=\"\" /> </span><span sizset=\"49\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvjh1.gif\" alt=\"\" /></span></div>\r\n</div>\r\n</div>', 'images/201404/thumb_img/484_thumb_G_1398127634370.jpg', 'images/201404/goods_img/484_G_1398127634935.jpg', 'images/201404/source_img/484_G_1398127634740.jpg', '1', '', '1', '1', '32', '1398127634', '100', '0', '1', '0', '0', '0', '0', '1398186622', '0', '', '-1', '-1', '0', '', '0');
