jpg\" alt=\"\" /> </dl></div>\r\n<p>&nbsp;</p>\r\n<div class=\"part_box clearfix\" sizset=\"38\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"38\" sizcache=\"39\">品牌文化</h4>\r\n<table width=\"780\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" sizset=\"42\" sizcache=\"17\">\r\n    <tbody sizset=\"42\" sizcache=\"17\">\r\n        <tr sizset=\"42\" sizcache=\"17\">\r\n            <td sizset=\"42\" sizcache=\"17\"><img width=\"340\" height=\"348\" src=\"http://img01.jiuxian.com/upload/goods/2765/b/1352271121513.jpg\" alt=\"\" /></td>\r\n            <td><font color=\"#666666\"><font size=\"2\">武汉酿酒历史久远，早在汉代，其酿酒之风流行。至于明清，则达鼎盛，其中尤以&ldquo;天成糟坊&rdquo;与&ldquo;德泰源酒坊&rdquo;最为有名。1952年，在原&ldquo;天成糟坊&rdquo;等基础上成立了武汉酒厂，主要生产&ldquo;汉酚酒&rdquo;。1984年，武汉酒厂更名为武汉酒厂。1992年，黄鹤楼酒厂改制为武汉黄鹤楼酒业集团。2003年6月，在省市两级政府支持下，武汉天龙投资有限公司注入巨资，对原武汉黄鹤楼酒业集团的资产进行重组，并在此基础上成立武汉天龙黄鹤楼酒业有限公司。<br />\r\n            武汉天龙黄鹤楼酒业有限公司成立于2003年6月，位于武汉市汉阳区鹦鹉大道558号，是集研发、生产、销售于一体的大型白酒企业，也是湖北省、武汉市政府全力打造的&ldquo;六大&rdquo;支柱产业及百年名牌工程之一，其前身可追溯到成立于1952年的武汉酒厂。</font> </font></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</div>\r\n<p>&nbsp;</p>\r\n<div class=\"part_box clearfix\" sizset=\"39\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"39\" sizcache=\"39\">酒厂介绍</h4>\r\n<p>&nbsp;</p>\r\n<table width=\"780\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" sizset=\"43\" sizcache=\"17\">\r\n    <tbody sizset=\"43\" sizcache=\"17\">\r\n        <tr sizset=\"43\" sizcache=\"17\">\r\n            <td sizset=\"43\" sizcache=\"17\">\r\n            <p sizset=\"43\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/2765/m/1352271308450.jpg\" alt=\"\" /></p>\r\n            <p>&nbsp;</p>\r\n            </td>\r\n            <td>\r\n            <p><font color=\"#666666\" size=\"2\">武汉天龙黄鹤楼酒业有限公司是武汉天龙投资有限公司的全资子公司，是湖北省、武汉市政府全力打造的&ldquo;六大&rdquo;支柱产业及百年名牌工程之一。公司是在省、市领导的直接关怀下，注入现代企业管理理念，引进先进经营模式，整合组建而成的集生产、经营、管理、销售、于一体的大型白酒企业。&ldquo;晴川历历汉阳树，芳草萋萋鹦鹉洲&rdquo;的传世佳话，成就天龙黄鹤楼酒工业园区，公司位于武汉市汉阳区鹦鹉大道558号，占地面积100多亩，环境优美，技术一流。公司以实力吸引了国内大量优秀人才，并购进国内领先的全自动灌装生产线，生产能力居于同行业领先水平。 </font></p>\r\n            <p>&nbsp;</p>\r\n            </td>\r\n        </tr>\r\n        <tr sizset=\"44\" sizcache=\"17\">\r\n            <td sizset=\"44\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/2765/m/1352271312810.jpg\" alt=\"\" /></td>\r\n            <td><font color=\"#666666\" size=\"2\">步入21世纪，黄鹤楼酒业磨剑十年、推陈出新，酿造出了新型浓香型白酒。该酒酒体丰满圆润，具有浓香郁雅、诸味谐调、尾味净爽、回味悠长的特点。产品包装由国际大奖&ldquo;莫比&rdquo;杰出成就奖获得者&mdash;&mdash;著名设计师陈小林教授亲自设计。包装整个设计简约、大气，追求环保，凸显高贵。广告策划由著名的叶茂中大师主持，黄鹤楼酒重现辉煌将成为他的又一精彩之作。黄鹤楼酒历经磨难，但是始终立于市场潮流的前沿，正如至今屹立不倒的黄鹤楼一样，体现着不屈不挠的英雄气概！</font></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</div>\r\n<p><input id=\"sych\" type=\"hidden\" value=\"商务用酒;礼节拜访;聚会用酒\" /></p>\r\n<div class=\"part_box clearfix\" sizset=\"40\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"40\" sizcache=\"39\">适宜场合</h4>\r\n<div class=\"sych\" sizset=\"55\" sizcache=\"27\">\r\n<div class=\"sych1\" id=\"gvsw0\" sizset=\"55\" sizcache=\"27\"><span sizset=\"45\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvsw1.gif\" alt=\"\" /> </span><span sizset=\"46\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvhq0.gif\" alt=\"\" /> </span><span sizset=\"47\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvlj1.gif\" alt=\"\" /> </span><span sizset=\"48\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvjh1.gif\" alt=\"\" /></span></div>\r\n</div>\r\n</div>\r\n<p>&nbsp;</p>', 'images/201404/thumb_img/492_thumb_G_1398128481608.jpg', 'images/201404/goods_img/492_G_1398128481179.jpg', 'images/201404/source_img/492_G_1398128481715.jpg', '1', '', '1', '1', '6', '1398128481', '100', '0', '1', '0', '0', '1', '0', '1398188759', '0', '', '-1', '-1', '0', '', '0');
INSERT INTO `jindong_goods` ( `goods_id`, `cat_id`, `goods_sn`, `goods_name`, `goods_name_style`, `click_count`, `brand_id`, `provider_name`, `goods_number`, `goods_weight`, `market_price`, `shop_price`, `promote_price`, `promote_start_date`, `promote_end_date`, `warn_number`, `keywords`, `goods_brief`, `goods_desc`, `goods_thumb`, `goods_img`, `original_img`, `is_real`, `extension_code`, `is_on_sale`, `is_alone_sale`, `integral`, `add_time`, `sort_order`, `is_delete`, `is_best`, `is_new`, `is_hot`, `is_promote`, `bonus_type_id`, `last_update`, `goods_type`, `seller_note`, `give_integral`, `rank_integral`, `suppliers_id`, `is_check`, `is_shipping` ) VALUES  ('493', '885', 'ECS000493', '52°宝丰国色清香鉴品500ml（双瓶套装）', '+', '1', '202', '', '1', '0.000', '403.20', '336.00', '0.00', '0', '0', '1', '', '', '<p>商品特点</p>\r\n<dl class=\"ass_share_dl2 clearfix\" sizset=\"36\" sizcache=\"17\">\r\n<p>&nbsp;</p>\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"780\" sizset=\"36\" sizcache=\"17\">\r\n    <tbody sizset=\"36\" sizcache=\"17\">\r\n        <tr sizset=\"36\" sizcache=\"17\">\r\n            <td sizset=\"36\" sizcache=\"17\"><img src=\"http://img10.jiuxian.com/bill/upload/goods/3745/f/1366252576757.jpg\" alt=\"\" /></td>\r\n            <td>&nbsp;</td>\r\n            <td>\r\n            <p><font color=\"#333333\" size=\"2\"><strong>清香淡雅 优质佳酿</strong></font></p>\r\n            <p><font color=\"#666666\" size=\"2\">国色清香鉴品酒，淡雅的蓝色半透明包装，如同其酒质一般清新淡雅，国色清香精选原生态产区优质原粮，吮天地之灵气，吸日月之精华，好粮好曲好工艺，假以酿制时日，方成佳酿。以贮藏15年的优质原酒为酒基，科学调制而成。酒体清澈透明、柔和饱满，闻之清香芬芳，品之甘润爽口。</font></p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p sizset=\"37\" sizcache=\"17\"><img alt=\"\" src=\"http://img01.jiuxian.com/images/upload/Image/pd_tit_kinds_03.jpg\" width=\"750\" height=\"86\" style=\"padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px\" /></p>\r\n</dl><!--part_box over-->\r\n<div class=\"part_box clearfix\" sizset=\"36\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"36\" sizcache=\"39\">商品展示</h4>\r\n<dl class=\"ass_share_dl2 clearfix\" sizset=\"38\" sizcache=\"17\"><img src=\"http://img10.jiuxian.com/bill/upload/goods/14070/g/1389663314366.jpg\" alt=\"\" /> </dl><!--detail_prtpic over--></div>\r\n<!--part_box over-->\r\n<div class=\"part_box clearfix\" sizset=\"37\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"37\" sizcache=\"39\">品牌文化</h4>\r\n<p>&nbsp;</p>\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"780\" sizset=\"39\" sizcache=\"17\">\r\n    <tbody sizset=\"39\" sizcache=\"17\">\r\n        <tr sizset=\"39\" sizcache=\"17\">\r\n            <td sizset=\"39\" sizcache=\"17\"><img src=\"http://img10.jiuxian.com/bill/upload/goods/3760/b/1352256713810.jpg\" alt=\"\" /></td>\r\n            <td>&nbsp;</td>\r\n            <td>\r\n            <p><font color=\"#666666\" size=\"2\">宝丰酒，以四千余年&ldquo;仪狄造酒&rdquo;古法为传承，不断发展创新，并坚持&ldquo;四清&rdquo;酿造标准，缔造&ldquo;清香纯正、绵甜柔和、甘润爽口、回味悠长&rdquo;等特点品质，连续摘夺我国白酒评比会大奖，成为清香型白酒的典型代表。先后出口新加坡、几内亚，直销中国香港、澳门、台湾等地区，原酒出口量全国第一，成品酒出口河南省第一。 </font></p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td>&nbsp;</td>\r\n            <td>&nbsp;</td>\r\n            <td>&nbsp;</td>\r\n        </tr>\r\n        <tr sizset=\"40\" sizcache=\"17\">\r\n            <td sizset=\"40\" sizcache=\"17\"><img src=\"http://img10.jiuxian.com/bill/upload/goods/3760/b/1352256827107.jpg\" alt=\"\" /></td>\r\n            <td>&nbsp;</td>\r\n            <td>\r\n            <p><font color=\"#666666\" size=\"2\">历史，为企业打上深厚烙印。从夏、禹时的仪狄造酒起源；到隋唐时期的兴旺鼎盛，及明清时候的一路流香，在四千多年的历史中，宝丰酿造技艺绵延不绝，从未间断。历史的发展，也造就宝丰清香纯正的内涵。从大唐王朝把宝丰酒定为&ldquo;贡酒&rdquo;；到北宋，官方专设&ldquo;酒务&rdquo;，以管辖、指导宝丰酿造，宝丰清香，一路流芳。</font></p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n</div>\r\n<!--part_box over-->\r\n<div class=\"part_box clearfix\" sizset=\"38\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"38\" sizcache=\"39\">酒厂介绍</h4>\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"780\" sizset=\"41\" sizcache=\"17\">\r\n    <tbody sizset=\"41\" sizcache=\"17\">\r\n        <tr sizset=\"41\" sizcache=\"17\">\r\n            <td sizset=\"41\" sizcache=\"17\"><font color=\"#666666\" size=\"2\" sizset=\"41\" sizcache=\"17\"><img src=\"http://img10.jiuxian.com/bill/upload/goods/3760/m/1363331921211.jpg\" alt=\"\" /></font></td>\r\n            <td>&nbsp;</td>\r\n            <td>\r\n            <p><br />\r\n            <font color=\"#666666\" size=\"2\">始建于1948年的宝丰酒业有限公司，是苏鲁豫皖四省中唯一一家生产</font></p>\r\n            <p><font color=\"#666666\" size=\"2\">清香型白酒的企业，位列中国十七大名酒；所生产酿造的清香产品系</font></p>\r\n            <p><font color=\"#666666\" size=\"2\">列，是河南名牌产品。企业先后被评为全国质量管理优秀企业、全国</font></p>\r\n            <p><font color=\"#666666\" size=\"2\">食品工业优秀企业、全国酿酒行业双百家企业、全国白酒工业百强企</font></p>\r\n            <p><font color=\"#666666\" size=\"2\">业、ISO9001质量体系认证企业等。2006年4月，宝丰酒业成功改制，</font></p>\r\n            <p><font color=\"#666666\" size=\"2\">迎来企业全新发展。为是实现可持续发展，近年来宝丰投资3亿多元</font></p>\r\n            <p><font color=\"#666666\" size=\"2\">，进行技术改造和科研开发。</font></p>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td>&nbsp;</td>\r\n            <td>&nbsp;</td>\r\n            <td>&nbsp;</td>\r\n        </tr>\r\n        <tr sizset=\"42\" sizcache=\"17\">\r\n            <td sizset=\"42\" sizcache=\"17\"><font color=\"#666666\" size=\"2\" sizset=\"42\" sizcache=\"17\"><img src=\"http://img10.jiuxian.com/bill/upload/goods/3760/m/1363331928176.jpg\" alt=\"\" /></font></td>\r\n            <td>&nbsp;</td>\r\n            <td>\r\n            <p><font color=\"#666666\" size=\"2\">2008年，投资300多万元，对制曲设备、酿造设备进行更新改造，提</font></p>\r\n            <p><font color=\"#666666\" size=\"2\">高了产品质量和产量；投资6800多万元，上了万吨储酒工程暨配套自</font></p>\r\n            <p><font color=\"#666666\" size=\"2\">动化灌装生产线，建成后新增1万吨储酒能力，5万吨调酒及灌装能力</font></p>\r\n            <p><font color=\"#666666\" size=\"2\">；加大生产，使企业年销量达20000吨，成品酒产品30000吨，原酒存</font></p>\r\n            <p><font color=\"#666666\" size=\"2\">酒量30000吨；2010年完成产值8.9亿元&hellip;&hellip;此外，宝丰还组织科研人</font></p>\r\n            <p><font color=\"#666666\" size=\"2\">员自行研发出哈工业首创的地缸发酵温度控制系统，成功解决发酵温</font></p>\r\n            <p><font color=\"#666666\" size=\"2\">度控制难的问题，提高了酿酒产量和质量，由此，宝丰逐步成为了集</font></p>\r\n            <p><font color=\"#666666\" size=\"2\">研发、生产、酿造、灌注、包装、销售为一体的大型酒企，各项主要</font></p>\r\n            <p><font color=\"#666666\" size=\"2\">经济指标均大幅攀升，销售收入连年翻番。</font></p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</div>\r\n<!--part_box over-->\r\n<div class=\"part_box clearfix\" sizset=\"39\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"39\" sizcache=\"39\">获奖荣誉</h4>\r\n<p><font color=\"#666666\" size=\"2\">&middot;1956年，宝丰酒被评为河南名酒；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">&middot;1979年、1984年，在全国第三届、第四届白酒评比中，蝉联两届国优，并获国家银质奖；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">&middot;1989年，全国第五届白酒评比中，以得分最高荣获国家金质奖，晋升17大中国名酒；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">&middot;2002年，39度、46度清香型宝丰酒，被授予&ldquo;中华人民共和国国家标准样品&rdquo;称号；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">&middot;2002年，宝丰系列酒获国家&ldquo;原产地&rdquo;标记保护注册认证；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">&middot;2008年，宝丰酒酿造技艺入选第二批&ldquo;国家级非物质文化遗产&rdquo;名录；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">&middot;2009年，宝丰酒获&ldquo;纯粮固态发酵白酒标志&rdquo;授牌，荣升高档之列，体现酿造最高荣誉；</font></p>\r\n<p><font color=\"#666666\" size=\"2\">&middot;2010年，荣获&ldquo;中华老字号&rdquo;（4000余年清香典范）荣耀认证；</font></p>\r\n</div>\r\n<p><!--part_box--><!--part_box--><!-- 酒具适用场合 start--><!-- 酒具适用场合 end--><!--part_box--><input id=\"sych\" type=\"hidden\" value=\"礼节拜访;聚会用酒\" /></p>\r\n<div class=\"part_box clearfix\" sizset=\"40\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"40\" sizcache=\"39\">适宜场合</h4>\r\n<div class=\"sych\" sizset=\"56\" sizcache=\"27\">\r\n<div id=\"gvsw0\" class=\"sych1\" sizset=\"56\" sizcache=\"27\"><span sizset=\"43\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvsw0.gif\" alt=\"\" /> </span><span sizset=\"44\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvhq0.gif\" alt=\"\" /> </span><span sizset=\"45\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvlj1.gif\" alt=\"\" /> </span><span sizset=\"46\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvjh1.gif\" alt=\"\" /> </span></div>\r\n</div>\r\n</div>', 'images/201404/thumb_img/493_thumb_G_1398128518604.jpg', 'images/201404/goods_img/493_G_1398128518397.jpg', 'images/201404/source_img/493_G_1398128518540.jpg', '1', '', '1', '1', '3', '1398128518', '100', '0', '1', '0', '0', '0', '0', '1398186442', '0', '', '-1', '-1', '0', '', '0');
INSERT INTO `jindong_goods` ( `goods_id`, `cat_id`, `goods_sn`, `goods_name`, `goods_name_style`, `click_count`, `brand_id`, `provider_name`, `goods_number`, `goods_weight`, `market_price`, `shop_price`, `promote_price`, `promote_start_date`, `promote_end_date`, `warn_number`, `keywords`, `goods_brief`, `goods_desc`, `goods_thumb`, `goods_img`, `original_img`, `is_real`, `extension_code`, `is_on_sale`, `is_alone_sale`, `integral`, `add_time`, `sort_order`, `is_delete`, `is_best`, `is_new`, `is_hot`, `is_promote`, `bonus_type_id`, `last_update`, `goods_type`, `seller_note`, `give_integral`, `rank_integral`, `suppliers_id`, `is_check`, `is_shipping` ) VALUES  ('494', '878', 'ECS000494', '52°黄鹤楼15年秘酿500ml', '+', '1', '190', '', '1', '0.000', '549.00', '259.00', '0.00', '0', '0', '1', '', '', '<h4 class=\"h4_ass\" sizset=\"38\" sizcache=\"39\">商品特点</h4>\r\n<p>&nbsp;</p>\r\n<dl class=\"ass_share_dl2 clearfix\" sizset=\"39\" sizcache=\"17\">\r\n<p sizset=\"39\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/2768/f/1389593194377.jpg\" alt=\"\" /></p>\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(60, 62, 61); line-height: 28px; font-family: 宋体, Verdana, Arial; font-size: 14px;\"><font color=\"#666666\" size=\"2\"><strong><font color=\"#333333\">岁月洗礼  经典之作：</font></strong>黄鹤楼15年秘酿凭借传统酿造工艺历经数个世纪的洗礼，以去粗取精、去伪存真的酿造真髓，融会现代科技，形成了黄鹤归来酒的独特稀有的酿造工艺。其酒以水、高粱、小麦、玉米、糯米和大米为原料，汇五谷精华，经传统酿造，窖藏磨砺，自然老熟，精心酿制而成，口味浓香，口感绵和，积黄鹤之灵以酿其味，循楚地之法以铸其魂。</font></p>\r\n<p sizset=\"40\" sizcache=\"17\" style=\"margin: 0px; padding: 0px; color: rgb(60, 62, 61); line-height: 28px; font-family: 宋体, Verdana, Arial; font-size: 14px;\"><img width=\"750\" height=\"86\" alt=\"\" src=\"http://img01.jiuxian.com/images/upload/Image/pd_tit_kinds_02.jpg\" style=\"margin: 0px; padding: 0px; border: currentColor;\" /></p>\r\n</dl>\r\n<p>&nbsp;</p>\r\n<div class=\"part_box clearfix\" sizset=\"39\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"39\" sizcache=\"39\">商品展示</h4>\r\n<dl class=\"ass_share_dl2 clearfix\" sizset=\"41\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/2768/g/1389593207364.jpg\" alt=\"\" /> </dl></div>\r\n<p>&nbsp;</p>\r\n<div class=\"part_box clearfix\" sizset=\"40\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"40\" sizcache=\"39\">品牌文化</h4>\r\n<table width=\"780\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" sizset=\"42\" sizcache=\"17\">\r\n    <tbody sizset=\"42\" sizcache=\"17\">\r\n        <tr sizset=\"42\" sizcache=\"17\">\r\n            <td sizset=\"42\" sizcache=\"17\"><img width=\"340\" height=\"348\" src=\"http://img01.jiuxian.com/upload/goods/2765/b/1352271121513.jpg\" alt=\"\" /></td>\r\n            <td><font color=\"#666666\"><font size=\"2\">武汉酿酒历史久远，早在汉代，其酿酒之风流行。至于明清，则达鼎盛，其中尤以&ldquo;天成糟坊&rdquo;与&ldquo;德泰源酒坊&rdquo;最为有名。1952年，在原&ldquo;天成糟坊&rdquo;等基础上成立了武汉酒厂，主要生产&ldquo;汉酚酒&rdquo;。1984年，武汉酒厂更名为武汉酒厂。1992年，黄鹤楼酒厂改制为武汉黄鹤楼酒业集团。2003年6月，在省市两级政府支持下，武汉天龙投资有限公司注入巨资，对原武汉黄鹤楼酒业集团的资产进行重组，并在此基础上成立武汉天龙黄鹤楼酒业有限公司。<br />\r\n            武汉天龙黄鹤楼酒业有限公司成立于2003年6月，位于武汉市汉阳区鹦鹉大道558号，是集研发、生产、销售于一体的大型白酒企业，也是湖北省、武汉市政府全力打造的&ldquo;六大&rdquo;支柱产业及百年名牌工程之一，其前身可追溯到成立于1952年的武汉酒厂。</font> </font></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</div>\r\n<p>&nbsp;</p>\r\n<div class=\"part_box clearfix\" sizset=\"41\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"41\" sizcache=\"39\">酒厂介绍</h4>\r\n<p sizset=\"43\" sizcache=\"17\">&nbsp;</p>\r\n<table width=\"780\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" sizset=\"43\" sizcache=\"17\">\r\n    <tbody sizset=\"43\" sizcache=\"17\">\r\n        <tr sizset=\"43\" sizcache=\"17\">\r\n            <td sizset=\"43\" sizcache=\"17\">\r\n            <p sizset=\"43\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/2765/m/1352271308450.jpg\" alt=\"\" /></p>\r\n            <p>&nbsp;</p>\r\n            </td>\r\n            <td>\r\n            <p><font color=\"#666666\" size=\"2\">武汉天龙黄鹤楼酒业有限公司是武汉天龙投资有限公司的全资子公司，是湖北省、武汉市政府全力打造的&ldquo;六大&rdquo;支柱产业及百年名牌工程之一。公司是在省、市领导的直接关怀下，注入现代企业管理理念，引进先进经营模式，整合组建而成的集生产、经营、管理、销售、于一体的大型白酒企业。&ldquo;晴川历历汉阳树，芳草萋萋鹦鹉洲&rdquo;的传世佳话，成就天龙黄鹤楼酒工业园区，公司位于武汉市汉阳区鹦鹉大道558号，占地面积100多亩，环境优美，技术一流。公司以实力吸引了国内大量优秀人才，并购进国内领先的全自动灌装生产线，生产能力居于同行业领先水平。 </font></p>\r\n            <p>&nbsp;</p>\r\n            </td>\r\n        </tr>\r\n        <tr sizset=\"44\" sizcache=\"17\">\r\n            <td sizset=\"44\" sizcache=\"17\"><img src=\"http://img01.jiuxian.com/upload/goods/2765/m/1352271312810.jpg\" alt=\"\" /></td>\r\n            <td><font color=\"#666666\" size=\"2\">步入21世纪，黄鹤楼酒业磨剑十年、推陈出新，酿造出了新型浓香型白酒。该酒酒体丰满圆润，具有浓香郁雅、诸味谐调、尾味净爽、回味悠长的特点。产品包装由国际大奖&ldquo;莫比&rdquo;杰出成就奖获得者&mdash;&mdash;著名设计师陈小林教授亲自设计。包装整个设计简约、大气，追求环保，凸显高贵。广告策划由著名的叶茂中大师主持，黄鹤楼酒重现辉煌将成为他的又一精彩之作。黄鹤楼酒历经磨难，但是始终立于市场潮流的前沿，正如至今屹立不倒的黄鹤楼一样，体现着不屈不挠的英雄气概！</font></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n</div>\r\n<p>&nbsp;</p>\r\n<div class=\"part_box clearfix\" sizset=\"42\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"42\" sizcache=\"39\">获奖荣誉</h4>\r\n<p style=\"margin: 0px; padding: 0px; color: rgb(60, 62, 61); line-height: 28px; font-family: 宋体, Verdana, Arial; font-size: 14px;\">&nbsp;</p>\r\n</div>\r\n<p><input id=\"sych\" type=\"hidden\" value=\"商务用酒;礼节拜访\" /></p>\r\n<div class=\"part_box clearfix\" sizset=\"43\" sizcache=\"39\">\r\n<h4 class=\"h4_ass\" sizset=\"43\" sizcache=\"39\">适宜场合</h4>\r\n<div class=\"sych\" sizset=\"55\" sizcache=\"27\">\r\n<div class=\"sych1\" id=\"gvsw0\" sizset=\"55\" sizcache=\"27\"><span sizset=\"45\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvsw1.gif\" alt=\"\" /> </span><span sizset=\"46\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvhq0.gif\" alt=\"\" /> </span><span sizset=\"47\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvlj1.gif\" alt=\"\" /> </span><span sizset=\"48\" sizcache=\"17\"><img src=\"http://misc.jiuxian.com/img/goods/gvjh0.gif\" alt=\"\" /></span></div>\r\n</div>\r\n</div>\r\n<p>&nbsp;</p>', 'images/201404/thumb_img/494_thumb_G_1398128581800.jpg', 'images/201404/goods_img/494_G_1398128581314.jpg', 'images/201404/source_img/494_G_1398128581150.jpg', '1', '', '1', '1', '2', '1398128581', '100', '0', '1', '0', '0', '0', '0', '1398184653', '0', '', '-1', '-1', '0', '', '0');
